                'aboutUsContain3': 'THE SITE OFFERS A WIDE SELECTION OF CLOTHING, SHOES, BAGS, ACCESSORIES, LUXURY HOME INTERIORS AND BEAUTY, WITH PRODUCTS AVAILABLE FOR MEN, WOMEN AND KIDS FROM THE MOST PRESTIGIOUS DESIGNERS SUCH AS BALENCIAGA, VETEMENTS, OFF-WHITE, J.W. ANDERSON,BALMAIN, DOLCE & GABBANA, GUCCI, SAINT LAURENT, VALENTINO, GIVENCHY, LOEWE, JACQUEMUS AND MORE.',
                'aboutUsContain4': 'THERE ARE CURRENTLY 200 PEOPLE FROM 15 DIFFERENT COUNTRIES THAT WORK TO PRODUCE AND MAINTAIN BRANDS & LABELS. THE SITE IS AVAILABLE IN 9 LANGUAGES: ENGLISH, ITALIAN, GERMAN, CHINESE, RUSSIAN, SPANISH, FRENCH, KOREAN AND JAPANESE. THE SITE IS CREATED ENTIRELY IN-HOUSE, WITH THE FLORENCE OFFICE HOUSING GRAPHIC DESIGN, IT, CUSTOMER SERVICE, MARKETING AND BUYING DEPARTMENTS. THE STYLISTS AND PRESS TEAMS OPERATE FROM THE BRANDSLABELS OFFICE IN THE FASHION CAPITAL OF THE WORLD – MILAN.',
                'aboutUsContain5': 'ALL ORDERS ARE SHIPPED WORLDWIDE FROM THE BRANDS & LABELS HEADQUARTERS IN BOXES THAT ARE PREPARED WITH MAXIMUM CARE AND USE THE FINEST MATERIALS, FROM THE SIGNATURE SHOE BAGS TO THE PERSONALIZED RIBBON.',
                'aboutUsContain6': 'BRANDSLABELS HAD 1.5 MILLION UNIQUE VISITORS ACCESS THE SITE IN 2008 AND HAS GROWN TO 53 MILLION UNIQUE VISITORS IN 2017. MORE THAN 15% OF ONLINE SALES ARE GENERATED FROM THE UNITED STATES, FOLLOWED BY GERMANY, UK, ITALY, CHINA AND FRANCE.',
                'aboutUsContain7': 'BRANDSLABELS PUSHES THE BOUNDARIES OF THE LUXURY RETAIL LANDSCAPE BOTH ON AND OFFLINE WITH AN ARRAY OF EXCLUSIVE SERVICES AND TRADEMARK INITIATIVES INCLUDING BUY IT FIRST, LUXURY CLUB, SNEAKERS CLUB, LVR PRIVILEGE AND LVR EDITIONS.',
