                'charityContain2': 'En las hamacas de hoja amarilla creemos que la creación ética de empleo es una solución a largo plazo para la pobreza extrema.',
                'charityContain3': 'En lugar de organizar un mosaico de donaciones de caridad para proporcionar agua, nutrición, ropa, etc., estamos trabajando directamente con las familias para construir una estrategia integral, digna y a largo plazo hacia un futuro más brillante. Las causas detrás de la pobreza sistémica son complicadas, pero la estabilidad financiera a largo plazo está al alcance.',
                'charityContain4': 'En pocas palabras: al centrarnos en los medios de vida, podemos eliminar al intermediario, obtener dinero directamente en manos de madres inteligentes + ingeniosas y capacitar a las familias para abordar sus propios problemas (sin estar sujetos a la agenda de nadie más).',
                'charityContain5': 'En tres comunidades de tejido, estamos trabajando para crear empleos para las madres y construir una base para la transformación de la comunidad positiva. A través del trabajo flexible y seguro de tejido de \"salario de prosperidad\", nuestros artesanos pueden levantar a sus familias de la pobreza y la esclavitud de la deuda a la clase media.',
                'charityContain6': '** Crear empleos para mujeres es especialmente importante para la transformación comunitaria: la investigación muestra que las mujeres gastarán hasta el 90% de sus ganancias en la salud, la nutrición y la educación de sus familias. Convertir a las mujeres en sostén de la familia mejora su estatus en la comunidad, desarrolla autoestima y les permite agrupar recursos para mejorar la infraestructura.',
