                'refundTitle': 'Reembolsos',
                'returnProcessTitle': 'Proceso de devoluciones',
                'customisedTitle': 'Artículos personalizados, usados ​​y vintage',
                'howToReturnTitle': 'Cómo regresar',
                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Los artículos deben ser devueltos sin daños, sin daños y sin usar, con todas las etiquetas adjuntas y el empaque original incluido.',
                'returnPolicyContain3': 'El calzado y los accesorios deben devolverse con las cajas de marca originales y las bolsas de polvo, donde se proporcionan, y colocarse dentro de una caja externa protectora para el envío.',
                'returnPolicyContain4': 'Al intentar el calzado, tenga cuidado de no marcar las plantas o dañar la caja de zapatos.',
                'returnPolicyContain5': 'Si un elemento tiene una etiqueta de seguridad avocica o etiqueta de marca adjunta, debe devolverse con la etiqueta en su original.',
                'returnPolicyContain6': 'Los productos de belleza y cosméticos deben devolverse sin abrir y no usar, con los sellos de cualquier empaque aún intacto.',
                'returnPolicyContain7': 'Los artículos de calcetería, lencería y trajes de baño deben devolverse con los sellos de higiene conectados y en envases de productos sin abrir y sin daños, cuando corresponda.',
                'returnPolicyContain8': 'La lencería y el traje de baño solo deben probarse sobre su propia ropa interior. No aceptaremos ningún rendimiento que haya sido usado o sucio.',
                'returnPolicyContain9': 'Las máscaras faciales deben devolverse en su embalaje de productos original, sin abrir y sin daños. Las joyas deben devolverse en la misma condición en la que llegó, incluidos todos los empaques de marca y documentos proporcionados.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Si realizó un pedido como invitado, puede comenzar su regreso aquí. Para devolver o cancelar un elemento que se ha hecho según sus especificaciones, consulte nuestra sección \"Elementos personalizados\" a continuación para obtener más información.',
                'aboutUsText': 'Sobre nosotros',
                'aboutUsTitle': 'Somos marca y etiquetas',
                'aboutUsContain': 'Explore los 100 de las mejores marcas del mundo',
                'aboutUsContain1': 'Brands & Labels es un destino de moda de lujo en línea con 5 millones de visitantes por mes y envío mundial.',
                'aboutUsContain2': 'El sitio web presenta la mejor selección de los mejores diseñadores establecidos, así como los jóvenes talentos emergentes. Brands & labels se fundó en Florencia a principios de la década de 1930, con la apertura de la tienda conceptual homónima de la compañía en Via Roma. En línea desde 1999, la compañía atribuye el 90% de los ingresos totales a las ventas en línea. Hasta el día de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain3': 'El sitio ofrece una amplia selección de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza para el hogar, con productos disponibles para hombres, mujeres y niños de los diseñadores más prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus y más.',
                'aboutUsContain4': 'Actualmente hay 200 personas de 15 países diferentes que trabajan para producir y mantener Brandslabels. El sitio está disponible en 9 idiomas: inglés, italiano, alemán, chino, ruso, español, francés, coreano y japonés. El sitio se crea completamente internamente, con el diseño gráfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina de Brandslabels en la capital mundial de la moda: Milán.',
                'aboutUsContain5': 'Todos los pedidos se envían en todo el mundo desde la sede de las etiquetas de las marcas en cajas que se preparan con el máximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain6': 'Brandslabels tuvo 1,5 millones de visitantes únicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes únicos en 2017. Más del 15% de las ventas en línea se generan en los Estados Unidos, seguidos por Alemania, Reino Unido, Italia, China y Francia.',
                'aboutUsContain7': 'Brandslabels empuja los límites del panorama minorista de lujo tanto dentro como fuera de línea con una variedad de servicios exclusivos e iniciativas de marca registrada que incluyen Buy It First, Luxury Club, Sneakers Club, LVR Privilege y LVR Editions.',
