                'createNewTicket': 'Crear nuevo boleto',
                'positiveImpactSustainability': 'Impacto positivo + sostenibilidad',
                'thereAreStillMoreThanMSG': 'Todavía hay más de mil millones de personas alrededor del mundo que viven en la pobreza extrema en menos de \$ 1.25 por día. Solo en Tailandia, existen más de un millón de miembros de las tribus de Hill en los márgenes de la sociedad, negó la ciudadanía, excluyeron el mercado laboral formal y vulnerable a la explotación y la trata.',
                'atYellowLeafHammocksMsg': 'En las hamacas de hoja amarilla creemos que la creación ética de empleo es una solución a largo plazo para la pobreza extrema.',
                'insteadOfOrganizingMsg': 'En lugar de organizar un mosaico de donaciones de caridad para proporcionar agua, nutrición, ropa, etc., estamos trabajando directamente con las familias para construir una estrategia integral, digna y a largo plazo hacia un futuro más brillante. Las causas detrás de la pobreza sistémica son complicadas, pero la estabilidad financiera a largo plazo está al alcance.',
                'toPutItSimplyMsg': 'En pocas palabras: al centrarnos en los medios de vida, podemos eliminar al intermediario, obtener dinero directamente en manos de madres inteligentes + ingeniosas y capacitar a las familias para abordar sus propios problemas (sin estar sujetos a la agenda de nadie más).',
                'acrossThreeWeavingCommunitiesMsg': 'En tres comunidades de tejido, estamos trabajando para crear empleos para las madres y construir una base para la transformación de la comunidad positiva. A través del trabajo flexible y seguro de tejido de \"salario de prosperidad\", nuestros artesanos pueden levantar a sus familias de la pobreza y la esclavitud de la deuda a la clase media.',
                'creatingJobsForWomenMsg': '** Crear empleos para mujeres es especialmente importante para la transformación comunitaria: la investigación muestra que las mujeres gastarán hasta el 90% de sus ganancias en la salud, la nutrición y la educación de sus familias. Convertir a las mujeres en sostén de la familia mejora su estatus en la comunidad, desarrolla autoestima y les permite agrupar recursos para mejorar la infraestructura.',
                'theFoundationForABrighterFuter': 'La base de un futuro más brillante',
                'theSecurityOfAStableMsg': 'La seguridad de una fuente de ingresos estable y creciente tuvo un tremendo impacto en la aldea. Los Mlabri pudieron comenzar una escuela y construir un centro comunitario para tejer y socializar. Establecieron uno de los primeros fondos de desempleo de Tailandia. Con un mayor poder económico, presionaron con éxito la ciudadanía y los derechos civiles, que se les otorgó por primera vez en 2001. El tejido de hamaca es un trabajo flexible, ideal para madres que pueden trabajar desde casa y hacer sus propios horarios. Desafortunadamente, sin acceso a los mercados globales, la demanda de hamacas se limitaba a la temporada de turismo tailandés y no había forma de garantizar un empleo durante todo el año.',
                'spreadingLastingChangeTheHammockRrevolution': 'Difundir un cambio duradero: la rrevolución de la hamaca',
                'thisIsAboutWhereMsg': '¡Aquí se trata de donde Yellow Leaf se une a la historia! En los últimos años, hemos trabajado para desarrollar canales de ventas consistentes, crear asociaciones internacionales y estabilizar operaciones dentro de las aldeas.',
                'corollaryEconomicMsg': 'Las oportunidades económicas del corolario, como una oficina de correos, la preparación de alimentos y el cultivo de café sostenible han surgido para emplear a los que no están tejiendo. Nuestra asociación con Kiva ha estimulado la capacitación financiera y la planificación financiera, ¡y muchos tejedores abren cuentas bancarias por primera vez en sus vidas!',
                'wWithOurGrowthMsg': 'Con nuestro crecimiento continuando acelerando, no solo podremos emplear a todos los tejedores de Mlabri durante todo el año, sino que también podremos continuar expandiéndonos y brindando capacitación y empleo continuo a las comunidades de tribu Hill en la región circundante. Hasta que el trabajo de tejido y los trabajos sostenibles estén disponibles en toda el área, las prácticas agrícolas destructivas continuarán y el ciclo de explotación de servidumbre por contrato no terminará realmente.',
                'throughTheEstablishmentMsg': 'A través del establecimiento de la hoja amarilla como una marca de estilo de vida global, los pueblos de las tribus de Hill con las que nos asociamos podrán mantener este impacto positivo y continuará sentando las bases para un futuro más brillante.',
