                'appNameTextsuv': 'SUV y NAT',
                'charityTitlesuv': 'Comprar más conscientemente',
                'charityContain1suv': 'Cada compra que realice ayudará a Buld A Childs Future.',
                'charityContain2suv': 'Sun & Nat: trabaja activamente para ayudar a cambiar el mundo y cada compra que realice en nuestro sitio nos ayuda a hacer lo mismo. Nos hemos asociado con algunas organizaciones benéficas y nos gustaría sus sugerencias para agregar las organizaciones benéficas y causas que cree que necesitan nuestra ayuda y aquellas que pueden marcar la diferencia en la vida de las personas.',
                'charityContain3suv': 'Sun & Nat donará el 3% de los ingresos de cada venta a una organización benéfica que elija o a una en nuestra lista si no elige una. Puede ayudar aún más a donar cualquier cantidad adicional en el pago.',
                'charityContain4suv': 'Si elige agregar 10 dólares, agregaremos más de 10 dólares como nuestra contribución adicional a nuestro 3% inicial (sujeto a un máximo del 10% del valor del pedido).',
                'charityContain5suv': 'Cada centavo se contabiliza y nuestro equipo trabaja duro para garantizar que el dinero llegue a las manos correctas.',
                'charityContain6suv': 'Le actualizamos cada paso del camino para que pueda estar satisfecho cuando sus contribuciones han cambiado y mejorado vidas.',
                'returnProcessTitlesuv': 'Proceso de retorno',
                'aboutUsTitlesuv': 'SUV & NAT es un destino de moda de lujo en línea con 5 millones de visitantes por mes y envío mundial.',
                'aboutUsContainsuv': 'El sitio web presenta la mejor selección de los mejores diseñadores establecidos, así como los jóvenes talentos emergentes. Brandslabels se fundó en Florencia a principios de la década de 1930, con la apertura de la tienda conceptual homónima de la compañía en Via Roma. En línea desde 1999, la compañía atribuye el 90% de los ingresos totales a las ventas en línea. Hasta el día de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain1suv': 'El sitio ofrece una amplia selección de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza para el hogar, con productos disponibles para hombres, mujeres y niños de los diseñadores más prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus y más.',
                'aboutUsContain2suv': 'Actualmente hay 200 personas de 15 países diferentes que trabajan para producir y mantener Brandslabels. El sitio está disponible en 9 idiomas: inglés, italiano, alemán, chino, ruso, español, francés, coreano y japonés. El sitio se crea completamente internamente, con el diseño gráfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina de los Suvandnats en la capital mundial de la moda: Milán.',
                'aboutUsContain3suv': 'Todos los pedidos se envían en todo el mundo desde la sede de Suvandnats en cajas que se preparan con el máximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain4suv': 'Los Suvandnats tenían 1,5 millones de visitantes únicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes únicos en 2017. Más del 15% de las ventas en línea se generan en los Estados Unidos, seguido por Alemania, Reino Unido, Italia, China y Francia.',
                'aboutUsContain5suv': 'Suvandnats empuja los límites del panorama minorista de lujo tanto dentro como fuera de línea con una variedad de servicios exclusivos e iniciativas de marca registrada que incluyen Buy It First, Luxury Club, Slakers Club, LVR Privilege y LVR Editions.',
