                'charityTitlesolo': 'Esperar',
                'charityContain1solo': 'Cuando nos compra, ayuda a apoyar a un sueño como un sueño para darle a un futuro seguro un entorno feliz y una vida saludable.',
                'charityContain2solo': 'La esperanza es nuestro proyecto para dar esperanza y oportunidades a aquellos que más lo necesitan. Cada dólar que gasta en nuestro sitio: ayuda a mejorar una vida en algún lugar, desde refugiados sirios hasta educar a los niños en África o proporcionar agua limpia, deseamos y esperamos hacer del mundo un lugar más igual.',
                'charityContain3solo': 'El 2% de cada venta realizada en nuestro sitio web va a ayudar a los más necesitados. También puede optar por contribuir con cualquier cantidad adicional que coincida además de nuestro 2%, hasta un máximo del 5% del valor del pedido.',
                'charityContain4solo': '¿Y lo que es más? Usted es actualizado por nosotros sobre la donación en todos los detalles posibles y sabe dónde se gastó el dinero y cómo ayudó a cambiar una vida.',
