                'returnPolicyTitlesolo': 'Política de devolución',
                'returnPolicyContain2solo': '1. Items must be returned unworn, undamaged and unused, with all tags attached and the original packaging included.',
                'returnPolicyContain3solo': '2. Footwear and accessories must be returned with the original branded boxes and dust bags, where provided, and placed inside a protective outer box for shipping.',
                'returnPolicyContain4solo': '3. When trying on footwear, please take care not to mark the soles or damage the shoe box.',
                'returnPolicyContain5solo': '4. If an item has a Avoirchic security tag or brand tag attached, it must be returned with the tag in its original.',
                'returnPolicyContain6solo': '5. Beauty and cosmetic products must be returned unopened and unused, with the seals of any packaging still intact.',
                'returnPolicyContain7solo': '6. Hosiery, lingerie and swimwear items must be returned with the hygiene seals attached and in unopened and undamaged product packaging, where applicable.',
                'returnPolicyContain8solo': '7. Lingerie and swimwear must only be tried on over your own undergarments. We will not accept any returns that have been worn or are soiled.',
                'returnPolicyContain9solo': '8. Face masks must be returned unworn in their original, unopened and undamaged product packaging.',
                'returnPolicyContain12': '9. Las joyas deben devolverse en la misma condición en las que llegó, incluidos todos los empaques de marca y documentos proporcionados.',
                'aboutUsContain1solo': 'Solo es un destino de moda de lujo en línea con 5 millones de visitantes por mes y envío mundial.',
                'aboutUsContain2solo': 'El sitio web presenta la mejor selección de diseñadores establecidos de Thetop y talentos emergentes de Wellas Young. Solo se fundó en Florencia a principios de la década de 1930, con la apertura de la tienda conceptual homónima de la compañía a través de Roma. Hasta el día de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain3solo': 'El sitio ofrece una amplia selección de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza, con productos disponibles para hombres, mujeres y niños de los diseñadores más prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus y más.',
                'aboutUsContain4solo': 'Actualmente hay 200 personas de 15 países diferentes que trabajan para producir y mantener solo. El sitio está disponible en 9 idiomas: inglés, italiano, alemán, chino, ruso, español, francés, coreano y japonés. El sitio se crea completamente internamente, con el diseño gráfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina en solitario en la capital mundial de la moda: Milán.',
                'aboutUsContain5solo': 'Todos los pedidos se envían en todo el mundo desde la sede en solitario en cajas que se preparan con el máximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain6solo': 'Solo tenía 1,5 millones de visitantes únicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes únicos en 2017. Más del 15% de las ventas en línea se generan en los Estados Unidos, seguidos por Alemania, Reino Unido, Italia, China y Francia.',
                'aboutUsContain7solo': 'Solo empuja los límites del panorama minorista de lujo tanto dentro como fuera de línea con una variedad de servicios exclusivos e iniciativas de marca registrada que incluyen Buy It First, Luxury Club, Sneakers Club, LVR Privilege y LVR Editions.',
