                'appidveralusso': 'Veralusso',
                'charityTitleveralusso': 'Tu única compra puede cambiar una vida.',
                'charityContain1veralusso': 'Veralusso - trabaja activamente para ayudar a cambiar el mundo y cada compra que realice en nuestro sitio, nos ayuda a hacer lo mismo. Nos hemos asociado con algunas organizaciones benéficas y nos gustaría sus sugerencias para agregar las organizaciones benéficas y causas que cree que necesitan nuestra ayuda y aquellas que pueden marcar la diferencia en la vida de las personas.',
                'charityContain2veralusso': 'Se estima que 11 millones de niños menores de 5 años enfrentan hambre o hambre extrema en todo el mundo.',
                'charityContain3veralusso': 'Los casos de ancianos abandonados están en aumento en todo el mundo. El miedo a ser una carga necesita terminar.',
                'charityContain4veralusso': 'Estadísticas anuales. Aproximadamente 7.6 millones de animales ingresan al refugio de animales en todo el país. Aproximadamente 2.7 millones de refugios son sacrificados. Solo se adoptan alrededor de 2.7 millones de animales de refugio.',
                'charityContain5veralusso': 'Veralusso donará el 3% de los ingresos de cada venta a una organización benéfica que elija o a una en nuestra lista si no elige una. Puede ayudar aún más a donar cualquier cantidad adicional al finalizar el pago. Si elige agregar 10 dólares, agregaremos más de 10 dólares como nuestra contribución adicional adicional a nuestro 3% inicial (sujeto a un máximo del 10% del valor del pedido).',
                'charityContain6veralusso': 'Cada centavo se contabiliza y nuestro equipo trabaja duro para garantizar que el dinero alcance las manos correctas.',
                'charityContain7': 'Le actualizamos cada paso del camino para que pueda estar satisfecho cuando sus contribuciones han cambiado y mejorado vidas.',
