                'customisedTitleveralusso': 'Artículos personalizados, usados ​​y vintage',
                'aboutUsContainveralusso': 'Vera Lusso es un destino de moda de lujo en línea con 5 millones de visitantes por mes y envío mundial.',
                'aboutUsContain1veralusso': 'El sitio web presenta la mejor selección de diseñadores establecidos de Thetop y talentos emergentes de Wellas Young. Vera Lusso fue fundada en Florencia a principios de la década de 1930, con la apertura de la tienda conceptual homónima de la compañía en Via Roma. En línea desde 1999, la compañía atribuye el 90% de los ingresos totales a las ventas en línea. Hasta el día de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain2veralusso': 'El sitio ofrece una amplia selección de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza para el hogar, con productos disponibles para hombres, mujeres y niños de los diseñadores más prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe Jacquemus y más.',
                'aboutUsContain3veralusso': 'Actualmente hay 200 personas de 15 países diferentes que trabajan para producir y mantener a Vera Lusso. El sitio está disponible en 9 idiomas: inglés italiano, alemán, chino, ruso, francés español, coreano y japonés. El sitio se crea completamente internamente, con el diseño gráfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina de Vera Lusso en la capital mundial de la moda: Milán.',
                'aboutUsContain4veralusso': 'Todos los pedidos se envían en todo el mundo desde la sede de Vera Lusso en cajas que se preparan con el máximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain5veralusso': 'Vera Lusso tuvo 1,5 millones de visitantes únicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes únicos en 2017. Más del 15% de las ventas en línea se generan en los Estados Unidos, seguido por Alemania, Reino Unido, Italia, China y Francia.',
