                'getText': 'Получить',
                'charityTitle': 'Positive Impact + Sustainability',
                'charityContain1': 'В мире по-прежнему более миллиарда человек живут в условиях крайней нищеты менее чем на 1,25 доллара в день. Только в Таиланде более миллиона представителей горных племен существуют на обочине общества, лишены гражданства, закрыты от официального рынка труда и уязвимы для эксплуатации и торговли людьми.',
                'charityContain2': 'В гамаках желтых листьев мы считаем, что этическое создание рабочих мест является расширением возможностей долгосрочного решения для крайней нищеты.',
                'charityContain3': 'Вместо того, чтобы организовать лоскутное одеяло благотворительных пожертвований для обеспечения воды, питания, одежды и т. Д., Мы работаем напрямую с семьями, чтобы создать комплексную, достойную, долгосрочную стратегию в направлении более яркого будущего. Причины системной бедности сложны, но долгосрочная финансовая стабильность находится в пределах досягаемости.',
                'charityContain4': 'Проще говоря: сосредоточив внимание на средствах к существованию, мы можем вырезать среднего человека, получить деньги непосредственно в руки умных + находчивых матерей и дают семьям решать свои собственные проблемы (не подвергаясь чьей -либо повестке дня).',
                'charityContain5': 'В трех ткацких сообществах мы работаем над созданием рабочих мест для матерей и создаем основу для позитивной трансформации сообщества. Благодаря гибкой, безопасной ткачественной работе «Процвета по заработной плате» наши ремесленники могут поднять свои семьи из бедности и рабства долгов в средний класс.',
                'charityContain6': '** Создание рабочих мест для женщин особенно важно для трансформации сообщества - исследования показывают, что женщины проведут до 90% своих доходов на здоровье, питание и образование своих семей. Превращение женщин в кормильцы улучшает свой статус в обществе, создает самооценку и позволяет им объединять ресурсы для улучшения инфраструктуры.',
