                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Предметы должны быть возвращены невыраженными, не поврежденными и неиспользованными, со всеми прикрепленными тегами и исходной упаковкой.',
                'returnPolicyContain3': 'Обувь и аксессуары должны быть возвращены с оригинальными фирменными коробками и пыльными мешками, где предоставлены и размещены в защитной внешней коробке для доставки.',
                'returnPolicyContain4': 'При выборе на обуви, пожалуйста, позаботьтесь о том, чтобы не пометить подошвы и не повредить обувную коробку.',
                'returnPolicyContain5': 'Если элемент имеет прикрепленную бирку безопасности или тег бренда, он должен быть возвращен с тегом в оригинале.',
                'returnPolicyContain6': 'Красота и косметические продукты должны быть возвращены нераскрытыми и не используемыми, причем уплотнения любой упаковки все еще не повреждены.',
                'returnPolicyContain7': 'Хлоловы, белье и купальные предметы должны быть возвращены с прикрепленными гигиеновыми уплотнениями и в неоплачиваемой и неповрежденной упаковке продукта, где это применимо.',
                'returnPolicyContain8': 'Нижнее белье и купальники должны быть опробованы только над вашим собственным нижним бельем. Мы не примем никаких возвращений, которые были изношены или испачканы.',
                'returnPolicyContain9': 'Маски для лица должны быть ненадежны в их оригинальной, неоплачиваемой и неповрежденной упаковке продукта. Ювелирные изделия должны быть возвращены в том же состоянии, в которое он прибыл, включая все фирменные упаковки и документы, предоставленные с ней.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Если вы разместили заказ в качестве гостя, вы можете начать возвращение сюда. Чтобы вернуть или отменить элемент, который был сделан в ваши спецификации, пожалуйста, просмотрите наш раздел «Настраиваемые элементы» ниже для получения дополнительной информации.',
                'aboutUsText': 'О нас',
                'aboutUsTitle': 'Мы бренд и лейблы',
                'aboutUsContain': 'Изучите 100 лучших брендов миров',
                'aboutUsContain1': 'Brands & Labels - главное онлайн -модное направление роскошной моды с 5 миллионами посетителей в месяц и мировой доставкой.',
                'aboutUsContain2': 'На сайте представлен лучший выбор из ведущих дизайнеров, а также молодых новых талантов. Brands & labels был основан во Флоренции в начале 1930 -х годов, с открытием одноименного концептуального магазина компании на Roma. В Интернете с 1999 года компания приписывает 90% от общего дохода от онлайн -продаж. По сей день он остается 100% частным семейным бизнесом, а внук основателя Андреа Панконеси выступает в качестве генерального директора и его дочь Аннагреты Панконеси в качестве креативного директора.',
                'aboutUsContain3': 'Сайт предлагает широкий выбор одежды, обуви, сумок, аксессуаров, роскошных домашних интерьеров и красоты, с продуктами, доступными для мужчин, женщин и детей от самых престижных дизайнеров, таких как Balenciaga, Vetements, Off-White, J.W. Андерсон, Балмейн, Дольче и Габбана, Гуччи, Сен -Лоран, Валентино, Живанши, Лоу, Жакм и многое другое.',
                'aboutUsContain4': 'В настоящее время насчитывается 200 человек из 15 разных стран, которые работают над производством и поддержанием BrandSlabels. Сайт доступен на 9 языках: английский, итальянский, немецкий, китайский, русский, испанский, французский, корейский и японский. Сайт создан полностью на месте, с графическим дизайном Florence Office Housing, ИТ, обслуживанием клиентов, маркетингом и покупками. Стилисты и пресс -команды работают из офиса Brandslabels в столице моды мира - Милан.',
                'aboutUsContain5': 'Все заказы отправляются по всему миру из штаб -квартиры лейблов брендов в коробках, которые готовится с максимальной уходом и используют лучшие материалы, от фирменных мешков для обуви до персонализированной ленты.',
                'aboutUsContain6': 'BrandSlabels имел 1,5 миллиона уникальных посетителей в 2008 году, и в 2017 году вырос до 53 миллионов уникальных посетителей. В Соединенных Штатах производится более 15% онлайн -продаж, а затем Германия, Великобритания, Италия, Китай и Франция.',
                'aboutUsContain7': 'BrandSlabels раздвигает границы ландшафта роскошной розничной торговли как на и офлайн, так и в автономном режиме с множеством эксклюзивных услуг и инициатив на торговых знаках, в том числе «Купить его первым», «Роскошный клуб», «Клуб кроссовок», «Привилегия LVR» и LVR.',
