                'createNewTicket': 'Создайте новый билет',
                'positiveImpactSustainability': 'Положительное влияние + устойчивость',
                'thereAreStillMoreThanMSG': 'По -прежнему существует более миллиардов человек, живущих в крайней нищете менее чем на 1,25 доллара в день. Только в Таиланде на полях общества существует более миллиона членов Хилл -племен - отказавшись в гражданстве, выключенном от официального рынка труда и уязвимым для эксплуатации и торговли людьми.',
                'atYellowLeafHammocksMsg': 'В гамаках желтых листьев мы считаем, что этическое создание рабочих мест является расширением возможностей долгосрочного решения для крайней нищеты.',
                'insteadOfOrganizingMsg': 'Вместо того, чтобы организовать лоскутное одеяло благотворительных пожертвований для обеспечения воды, питания, одежды и т. Д., Мы работаем напрямую с семьями, чтобы создать комплексную, достойную, долгосрочную стратегию в направлении более яркого будущего. Причины системной бедности сложны, но долгосрочная финансовая стабильность находится в пределах досягаемости.',
                'toPutItSimplyMsg': 'Проще говоря: сосредоточив внимание на средствах к существованию, мы можем вырезать среднего человека, получить деньги непосредственно в руки умных + находчивых матерей и дают семьям решать свои собственные проблемы (не подвергаясь чьей -либо повестке дня).',
                'acrossThreeWeavingCommunitiesMsg': 'В трех ткацких сообществах мы работаем над созданием рабочих мест для матерей и создаем основу для позитивной трансформации сообщества. Благодаря гибкой, безопасной ткачественной работе «Процвета по заработной плате» наши ремесленники могут поднять свои семьи из бедности и рабства долгов в средний класс.',
                'creatingJobsForWomenMsg': '** Создание рабочих мест для женщин особенно важно для трансформации сообщества - исследования показывают, что женщины проведут до 90% своих доходов на здоровье, питание и образование своих семей. Превращение женщин в кормильцы улучшает свой статус в обществе, создает самооценку и позволяет им объединять ресурсы для улучшения инфраструктуры.',
                'theFoundationForABrighterFuter': 'Фонд для более яркого фута',
                'theSecurityOfAStableMsg': 'Безопасность стабильного, растущего источника доходов оказала огромное влияние на деревню. Млабри смог начать школу и построить общественный центр для ткачества и общения. Они создали один из первых средств по безработице в Таиланде. Благодаря увеличению экономической власти они успешно лоббировали гражданство и гражданские права, которые они впервые были предоставлены в 2001 году. Протекание гамака является гибкой работой, идеально подходящей для матерей, которые могут работать из дома и делать свои собственные графики. К сожалению, без доступа к мировым рынкам спрос на гамаки ограничивался тайским туристическим сезоном, и не было никакого способа обеспечить круглогодичную занятость.',
                'spreadingLastingChangeTheHammockRrevolution': 'Распространение длительных изменений: rrevolution гамака',
                'thisIsAboutWhereMsg': 'Это о том, где присоединяется желтый лист! За последние несколько лет мы работали над разработкой последовательных каналов продаж, строительство международных партнерских отношений и стабилизировали операции в деревнях.',
                'corollaryEconomicMsg': 'Экономические возможности для следствия, такие как почтовое отделение, приготовление пищи и устойчивое ведение кофе, возникли для использования тех, кто не плетение. Наше партнерство с Kiva стимулировало финансовое обучение и финансовое планирование, и многие ткачи открыли банковские счета впервые в своей жизни!',
                'wWithOurGrowthMsg': 'В связи с тем, что наш рост продолжает ускоряться, мы не только сможем использовать все ткачи Mlabri круглый год, но и продолжим расширять и проводить обучение и постоянную работу в общинах племени Hill в окружающем регионе. До тех пор, пока в этом районе не будут доступны ткацкие работы и устойчивые рабочие места, разрушительные сельскохозяйственные практики будут продолжаться, и эксплуатационный цикл нанятого рабства не закончится.',
                'throughTheEstablishmentMsg': 'Благодаря созданию желтого листа в качестве мирового бренда образа жизни, деревни Hill Tribe, с которыми мы сотрудничаем, смогут поддерживать это положительное влияние и продолжать закладывать основу для более светлого будущего.',
