                'charityContain2suv': 'Sun & Nat - активно работает, чтобы помочь изменить мир, и каждая покупка, которую вы совершаете на нашем сайте, помогает нам сделать то же самое. Мы сотрудничали с несколькими благотворительными организациями и хотели бы, чтобы ваши предложения добавили благотворительные организации и причины, которые, по вашему мнению, нуждаются в нашей помощи, и те, которые могут изменить жизнь людей.',
