                'aboutUsTitlesuv': 'Suv & Nat - главное онлайн -модное направление с 5 миллионами посетителей в месяц и мировой доставкой.',
                'aboutUsContainsuv': 'На сайте представлен лучший выбор из ведущих дизайнеров, а также молодых новых талантов. BrandSlabels был основан во Флоренции в начале 1930 -х годов, с открытием одноименного концептуального магазина компании на Roma. В Интернете с 1999 года компания приписывает 90% от общего дохода от онлайн -продаж. По сей день он остается 100% частным семейным бизнесом, а внук основателя Андреа Панконеси выступает в качестве генерального директора и его дочь Аннагреты Панконеси в качестве креативного директора.',
                'aboutUsContain1suv': 'Сайт предлагает широкий выбор одежды, обуви, сумок, аксессуаров, роскошных домашних интерьеров и красоты, с продуктами, доступными для мужчин, женщин и детей от самых престижных дизайнеров, таких как Balenciaga, Vetements, Off-White, J.W. Андерсон, Балмейн, Дольче и Габбана, Гуччи, Сен -Лоран, Валентино, Живанши, Лоу, Жакм и многое другое.',
                'aboutUsContain2suv': 'В настоящее время насчитывается 200 человек из 15 разных стран, которые работают над производством и поддержанием BrandSlabels. Сайт доступен на 9 языках: английский, итальянский, немецкий, китайский, русский, испанский, французский, корейский и японский. Сайт создан полностью на месте, с графическим дизайном Florence Office Housing, ИТ, обслуживанием клиентов, маркетингом и покупками. Стилисты и пресс -команды работают из офиса Suvandnats в столице моды мира - Милан.',
                'aboutUsContain3suv': 'Все заказы отправляются по всему миру из штаб -квартиры Suvandnats в коробках, которые готовится с максимальной уходом и используют лучшие материалы, от фирменных мешков для обуви до персонализированной ленты.',
                'aboutUsContain4suv': 'У Suvandnats было 1,5 миллиона уникальных посетителей в 2008 году, и в 2017 году вырос до 53 миллионов уникальных посетителей. Более 15% онлайн -продаж производится из Соединенных Штатов, за которыми следуют Германия, Великобритания, Италия, Китай и Франция.',
