                'appidveralusso': 'Вералуссо',
                'charityTitleveralusso': 'Ваша одна покупка может изменить жизнь.',
                'charityContain1veralusso': 'Veralusso - активно работает, чтобы помочь изменить мир и каждую покупку, которую вы совершаете на нашем сайте - помогает нам сделать то же самое. Мы сотрудничали с несколькими благотворительными организациями и хотели бы, чтобы ваши предложения добавили благотворительные организации и причины, которые, по вашему мнению, нуждаются в нашей помощи, и те, которые могут изменить жизнь людей.',
                'charityContain2veralusso': 'По оценкам, 11 миллионов детей в возрасте до 5 лет сталкиваются с крайним голодом или голодом по всему миру.',
                'charityContain3veralusso': 'Случаи заброшенных пожилых людей находятся во всем мире. Страх быть бременем должен закончиться.',
                'charityContain4veralusso': 'Годовая статистика. Приблизительно 7,6 миллиона животных входят в приют для животных по всей стране. Приблизительно 2,7 млн. Шеллеранималов эвтаназированы. Только около 2,7 миллиона приютов животных принимаются.',
                'charityContain5veralusso': 'Veralusso пожертвует 3% доходов от каждой продажи на благотворительную организацию, которую вы выбираете, или на один в нашем списке, если вы не выберете ее. Вы можете дополнительно помочь с пожертвованием любой дополнительной суммы при оформлении заказа. Если вы решите добавить 10 долларов, мы добавим еще 10 долларов в качестве дальнейшего вклада в дополнение к нашим первоначальным 3% (с учетом максимум 10% от стоимости заказа).',
                'charityContain6veralusso': 'Каждый цент учитывается, и наша команда усердно работает, чтобы деньги достигли правильных рук.',
                'charityContain7': 'Мы обновляем вас на каждом этапе пути, чтобы вы могли быть удовлетворены, когда ваш вклад изменился и улучшил жизнь.',
                'stLine1': 'Адрес (строка 1',
                'stLine2': 'Уличный адрес: строка 2',
                'stLine3': 'Уличный адрес: строка 3',
                'indiaTextveralusso': 'Индия',
                'stateTextveralusso': 'Пожалуйста, выберите регион, штат или провинция',
                'appNameTextveralusso': 'Вера Луссо',
                'customisedTitleveralusso': 'Индивидуальные, предварительные и винтажные предметы',
                'aboutUsContainveralusso': 'Вера Луссо является лучшим онлайн -местом для роскошной моды с 5 миллионами посетителей в месяц и всемирной доставкой.',
                'aboutUsContain1veralusso': 'На веб -сайте есть лучший выбор устоявшихся дизайнеров, а также новистых талантов. Вера Луссо была основана во Флоренции в начале 1930 -х годов с открытием одноименного концептуального магазина компании на Roma. В Интернете с 1999 года компания приписывает 90% от общего дохода от онлайн -продаж. По сей день он остается 100% частным семейным бизнесом, а внук основателя Андреа Панконеси выступает в качестве генерального директора и его дочь Аннагреты Панконеси в качестве креативного директора.',
                'aboutUsContain2veralusso': 'Сайт предлагает широкий выбор одежды, обуви, сумок, аксессуаров, роскошных домашних интерьеров и красоты, с продуктами, доступными для мужчин, женщин и детей от самых престижных дизайнеров, таких как Balenciaga, Vetements, Off-White, J.W. Андерсон, Балмейн, Дольче и Габбана, Гуччи, Сен -Лоран, Валентино, Живанши, Лоу Жакем и многое другое.',
                'aboutUsContain3veralusso': 'В настоящее время насчитывается 200 человек из 15 разных стран, которые работают над производством и поддержанием Вера Луссо. Сайт доступен на 9 языках: английский итальянский, немецкий, китайский, русский, испанский французский, корейский и японский. Сайт создан полностью на месте, с графическим дизайном Florence Office Housing, ИТ, обслуживанием клиентов, маркетингом и покупками. Стилисты и пресс -команды работают из офиса Вера Луссо в столице моды мира - Милана.',
                'aboutUsContain4veralusso': 'Все заказы отправляются по всему миру из штаб -квартиры Vera Lusso в коробках, которые приготовлены с максимальной уходом и используют лучшие материалы, от фирменных мешков для обуви до персонализированной ленты.',
                'aboutUsContain5veralusso': 'У Веры Луссо было 1,5 миллиона уникальных посетителей в 2008 году, и в 2017 году выросла до 53 миллионов уникальных посетителей. В Соединенных Штатах производится более 15% онлайн -продаж, а затем Германия, Великобритания, Италия, Китай и Франция.',
                'aboutUsContain6veralusso': 'Вера Луссо раздвигает границы роскошной розничной ландшафта как на, так и в автономном режиме с множеством эксклюзивных услуг и инициатив на торговых знаках, включая «Купить его первым», «Роскошный клуб», «Клуб кроссовок», «Привилегия LVR» и LVR.',
