                'charityContain3': '물, 영양, 의류 등을 제공하기 위해 자선 기부 패치를 조직하는 대신, 우리는 가족과 직접 협력하여 더 밝은 미래를 향한 포괄적이고 위엄있는 장기 전략을 세우고 있습니다. 체계적인 빈곤의 원인은 복잡하지만 장기적인 재무 안정성은 도달 할 수 있습니다.',
