                'aboutUsText': '우리에 대해',
                'aboutUsTitle': '우리는 브랜드 및 라벨입니다',
                'aboutUsContain': '세계 최고의 브랜드 100을 탐색하십시오',
                'aboutUsContain1': 'Brands & Labels는 한 달에 5 백만 명의 방문객과 전세계 배송을 보유한 최고의 온라인 고급 패션 목적지입니다.',
                'aboutUsContain2': '이 웹 사이트에는 최고의 기존 디자이너와 젊은 신흥 인재가 가장 잘 선택됩니다. Brandslabels는 1930 년대 초 피렌체에서 설립되었으며 Via Roma의 회사의 시조 컨셉 스토어가 문을 열었습니다. 1999 년부터 온라인 으로이 회사는 총 수익의 90%가 온라인 판매에 기인합니다. 오늘날까지는 창립자의 손자 인 Andrea Panconesi가 CEO와 그의 딸 Annagreta Panconesi를 크리에이티브 디렉터로 연기하면서 100% 개인 소유의 가족 사업으로 남아 있습니다.',
                'aboutUsContain3': '이 사이트는 Balenciaga, Vetements, Off-White, J.W와 같은 가장 유명한 디자이너의 남성, 여성 및 어린이가 이용할 수있는 다양한 의류, 신발, 가방, 액세서리, 럭셔리 홈 인테리어 및 미용을 제공합니다. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus 등.',
                'aboutUsContain4': '현재 15 개국에서 온 200 명이 브랜드 슬래브를 생산하고 유지하기 위해 노력하고 있습니다. 이 사이트는 영어, 이탈리아, 독일어, 중국어, 러시아어, 스페인어, 프랑스어, 한국 및 일본인 9 개 언어로 제공됩니다. 이 사이트는 Florence Office Housing Graphic Design, IT, 고객 서비스, 마케팅 및 구매 부서를 통해 완전히 사내에서 만들어집니다. 스타일리스트와 프레스 팀은 세계의 패션 수도 인 밀라노의 브랜드 슬라벨 사무소에서 운영됩니다.',
                'aboutUsContain5': '모든 주문은 전 세계적으로 브랜드 라벨 라벨 본사에서 최대의 관리로 준비된 상자에 전 세계적으로 배송되며 서명 신발 가방에서 개인화 된 리본에 이르기까지 최고의 재료를 사용합니다.',
                'aboutUsContain6': 'Brandslabels는 2008 년에 150 만 명의 고유 한 방문자 가이 사이트에 액세스했으며 2017 년에는 5,300 만 명의 고유 방문자로 성장했습니다. 온라인 판매의 15% 이상이 독일, 영국, 이탈리아, 중국 및 프랑스에서 생성됩니다.',
                'aboutUsContain7': 'BrandsLabels는 Buy It, Luxury Club, Sneakers Club, LVR Privilege 및 LVR Editions를 포함한 다양한 독점 서비스 및 상표 이니셔티브를 통해 On and Offline의 고급 소매 환경의 경계를 뛰어 넘습니다.',
