                'thereAreStillMoreThanMSG': '하루에 1.25 달러 미만의 극심한 빈곤에 처한 세계에있는 10 억 명이 넘는 사람들이 여전히 있습니다. 태국에서만 힐 부족의 백만 명이 넘는 힐 부족이 사회의 여백에 존재합니다. 거부 된 시민권, 공식적인 직업 시장에서 폐쇄되고 착취와 인신 매매에 취약합니다.',
