                'insteadOfOrganizingMsg': '물, 영양, 의류 등을 제공하기 위해 자선 기부 패치를 조직하는 대신, 우리는 가족과 직접 협력하여 더 밝은 미래를 향한 포괄적이고 위엄있는 장기 전략을 세우고 있습니다. 체계적인 빈곤의 원인은 복잡하지만 장기적인 재무 안정성은 도달 할 수 있습니다.',
                'toPutItSimplyMsg': '간단히 말해서 : 생계에 집중함으로써, 우리는 중간 남자를 잘라 내고, Smart + Rouberceful Mothers의 손에 직접 돈을 벌고, 가족이 자신의 문제를 해결할 수 있도록 권한을 부여 할 수 있습니다 (다른 사람의 의제에 영향을받지 않고).',
                'acrossThreeWeavingCommunitiesMsg': '3 개의 직조 공동체에서 우리는 어머니를위한 일자리를 창출하고 긍정적 인 공동체 변화를위한 토대를 구축하기 위해 노력하고 있습니다. 유연하고 안전한 \"번영 임금\"직조 작업을 통해 우리의 장인들은 빈곤과 부채 노예에서 중산층으로 가족을 높일 수 있습니다.',
                'creatingJobsForWomenMsg': '** 여성을위한 일자리 창출은 특히 지역 사회 변화에 중요합니다. 연구에 따르면 여성은 가족의 건강, 영양 및 교육에 최대 90%를 소비 할 것입니다. 여성을 빵가수로 바꾸면 지역 사회에서의 지위가 향상되고 자존감을 키우며 인프라를 개선하기 위해 자원을 풀 수 있습니다.',
                'theFoundationForABrighterFuter': '더 밝은 냄새를위한 기초',
                'theSecurityOfAStableMsg': '안정되고 성장하는 수익원의 보안은 마을에 엄청난 영향을 미쳤습니다. Mlabri는 학교를 시작하고 직조 및 사교를위한 커뮤니티 센터를 건설 할 수있었습니다. 그들은 태국 최초의 실업 기금 중 하나를 설립했습니다. 경제력이 증가함에 따라 그들은 2001 년에 처음 부여 된 시민권과 시민권을 위해 로비를 성공적으로 로비했습니다. Hammock Weaving은 유연한 일이며 집에서 일하고 일정을 만들 수있는 어머니에게 이상적입니다. 불행히도, 글로벌 시장에 접근 할 수 없다면 해먹에 대한 수요는 태국 관광 시즌으로 제한되었으며 연중 고용을 보장 할 방법이 없었습니다.',
                'spreadingLastingChangeTheHammockRrevolution': '지속적인 변화 확산 : Hammock Rrevolution',
                'thisIsAboutWhereMsg': '이것은 노란 잎이 이야기에 합류하는 곳입니다! 지난 몇 년 동안 우리는 일관된 판매 채널을 개발하고 국제 파트너십을 구축하며 마을 내에서 운영을 안정화하기 위해 노력해 왔습니다.',
                'corollaryEconomicMsg': '우체국, 음식 준비 및 지속 가능한 커피 농업과 같은 관상 경제 기회는 직조하지 않는 사람들을 고용하기 위해 생겨났습니다. Kiva와의 파트너십은 재무 교육 및 재무 계획을 자극했습니다.',
                'wWithOurGrowthMsg': '우리의 성장이 계속 가속화되면서, 우리는 일년 내내 모든 mlabri 위버를 고용 할 수있을뿐만 아니라 주변 지역의 Hill Tribe 커뮤니티에 계속 확장하고 훈련 및 지속적인 고용을 제공 할 수있을 것입니다. 해당 지역 전체에서 직조 작업과 지속 가능한 일자리를 구할 때까지 파괴적인 농업 관행이 계속 될 것이며 계약 된 종의 착취주기는 진정으로 끝나지 않을 것입니다.',
