                'charityContain4suv': '10 달러를 추가하기로 선택한 경우 초기 3% (주문 가치의 최대 10%에 따라)에 추가로 10 달러를 추가합니다.',
                'charityContain5suv': '모든 센트가 설명되고 우리 팀은 돈이 오른손에 도달하도록하기 위해 열심히 노력합니다.',
                'charityContain6suv': '우리는 당신의 기여가 바뀌고 삶을 개선했을 때 만족할 수 있도록 모든 단계를 업데이트합니다.',
                'returnProcessTitlesuv': '반환 프로세스',
                'aboutUsTitlesuv': 'SUV & NAT는 한 달에 5 백만 명의 방문객과 전세계 배송을 보유한 최고의 온라인 럭셔리 패션 목적지입니다.',
                'aboutUsContainsuv': '이 웹 사이트에는 최고의 기존 디자이너와 젊은 신흥 인재가 가장 잘 선택됩니다. Brandslabels는 1930 년대 초 피렌체에서 설립되었으며 Via Roma의 회사의 시조 컨셉 스토어가 문을 열었습니다. 1999 년부터 온라인 으로이 회사는 총 수익의 90%가 온라인 판매에 기인합니다. 오늘날까지는 창립자의 손자 인 Andrea Panconesi가 CEO와 그의 딸 Annagreta Panconesi를 크리에이티브 디렉터로 연기하면서 100% 개인 소유의 가족 사업으로 남아 있습니다.',
                'aboutUsContain1suv': '이 사이트는 Balenciaga, Vetements, Off-White, J.W와 같은 가장 유명한 디자이너의 남성, 여성 및 어린이가 이용할 수있는 다양한 의류, 신발, 가방, 액세서리, 럭셔리 홈 인테리어 및 미용을 제공합니다. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus 등.',
                'aboutUsContain2suv': '현재 15 개국에서 온 200 명이 브랜드 슬래브를 생산하고 유지하기 위해 노력하고 있습니다. 이 사이트는 영어, 이탈리아, 독일어, 중국어, 러시아어, 스페인어, 프랑스어, 한국 및 일본인 9 개 언어로 제공됩니다. 이 사이트는 Florence Office Housing Graphic Design, IT, 고객 서비스, 마케팅 및 구매 부서를 통해 완전히 사내에서 만들어집니다. 스타일리스트와 언론 팀은 세계의 패션 수도 인 밀라노의 Suvandnats 사무소에서 운영됩니다.',
                'aboutUsContain3suv': '모든 주문은 Suvandnats 본사에서 전 세계적으로 전 세계적으로 배송됩니다. 최대의 관리로 준비된 상자로, 서명 신발 가방에서 맞춤형 리본에 이르기까지 최고의 재료를 사용합니다.',
                'aboutUsContain4suv': 'Suvandnats는 2008 년에 150 만 명의 고유 한 방문자 가이 사이트에 액세스했으며 2017 년에는 5,300 만 명의 고유 방문자로 성장했습니다. 온라인 판매의 15% 이상이 독일, 영국, 이탈리아, 중국 및 프랑스에서 생성됩니다.',
                'aboutUsContain5suv': 'Suvandnats는 Buy It, Luxury Club, Sneakers Club, LVR Privilege 및 LVR Editions를 포함한 다양한 독점 서비스 및 상표 이니셔티브로 ON 및 오프라인으로 고급 소매 환경의 경계를 뛰어 넘습니다.',
