                'charityContain2solo': '희망은 우리의 프로젝트가 가장 필요한 사람들에게 희망과 기회를주기위한 프로젝트입니다. 시리아 난민에서 아프리카의 어린이 교육에 이르기까지 어딘가에있는 우리 사이트에서 지출하는 모든 달러는 아프리카의 어린이들을 교육하거나 깨끗한 물을 제공하는 데 도움이됩니다. 우리는 세상을 더 평등하게 만들기를 희망하고 희망합니다.',
