                'aboutUsContain5solo': '모든 주문은 솔로 본부에서 전 세계적으로 최대의 관리로 준비된 상자로 전 세계적으로 배송되며 시그니처 슈 가방부터 맞춤형 리본에 이르기까지 최고의 재료를 사용합니다.',
