                'charityContain4veralusso': '연간 통계. 약 760 만 마리의 동물이 전국적으로 동물 보호소에 들어갑니다. 약 270 만 대의 셸 테라니 말이 안락사됩니다. 약 270 만 명의 대피소 동물 만 입양됩니다.',
                'charityContain5veralusso': 'Veralusso는 모든 판매 수익금의 3%를 귀하가 선택한 자선 단체에 또는 선택하지 않으면 목록에있는 자선 단체에 기부합니다. 결제시 추가 금액을 기부하는 데 도움이 될 수 있습니다. 10 달러를 추가하기로 선택하면 초기 3% (주문 가치의 최대 10%에 따라)에 추가 기여로 10 달러를 추가 할 것입니다.',
