                'toPutItSimplyMsg': '簡単に言えば、生計に焦点を合わせることで、中間人を切り取り、賢く機知に富んだ母親の手に直接お金を稼ぎ、家族が自分の問題に取り組むことができます（他の人の議題の対象なしに）。',
                'acrossThreeWeavingCommunitiesMsg': '3つの織物コミュニティにまたがって、私たちは母親のために雇用を創出し、積極的なコミュニティ変革の基盤を構築するために取り組んでいます。私たちの職人は、柔軟で安全な「繁栄賃金」織りの仕事を通じて、家族を貧困や債務奴隷制から中流階級に引き上げることができます。',
                'creatingJobsForWomenMsg': '**女性の雇用を創出することは、コミュニティの変革にとって特に重要です - 研究は、女性が家族の健康、栄養、教育に収益の最大90％を費やすことを示しています。女性を稼ぎ手に変えることで、コミュニティでの地位が向上し、自尊心を構築し、リソースをプールしてインフラストラクチャを改善できます。',
                'theFoundationForABrighterFuter': '明るい未来の基礎',
                'theSecurityOfAStableMsg': '安定した成長する収益源の安全性は、村に多大な影響を与えました。 Mlabriは学校を始めて、織りと社交のためのコミュニティセンターを建設することができました。彼らはタイの最初の失業基金の1つを設立しました。経済力の向上により、彼らは2001年に最初に付与された市民権と公民権に成功しました。ハンモックウィービングは柔軟な仕事であり、自宅で仕事をして自分のスケジュールを作ることができる母親に最適です。残念ながら、グローバル市場へのアクセスがなければ、ハンモックの需要はタイの観光シーズンに限定されており、一年中雇用を確保する方法はありませんでした。',
