                'aboutUsContain4solo': '現在、ソロの生産と維持に取り組んでいる15か国から200人がいます。このサイトには、英語、イタリア語、ドイツ語、中国語、ロシア語、スペイン語、フランス語、韓国語、日本語の9つの言語があります。このサイトは完全に社内で作成されており、フィレンツェオフィスにはグラフィックデザイン、IT、顧客サービス、マーケティング、購入部門が住んでいます。スタイリストとプレスチームは、世界のファッションキャピタルのソロオフィスであるミラノから営業しています。',
