                'getText': 'Ottenere',
                'charityTitle': 'Positive Impact + Sustainability',
                'charityContain1': 'Ci sono ancora più di un miliardo di persone nel mondo che vivono in condizioni di estrema povertà con meno di 1,25 dollari al giorno. Nella sola Thailandia, più di un milione di membri delle tribù delle montagne vivono ai margini della società: cittadinanza negata, esclusi dal mercato del lavoro formale e vulnerabili allo sfruttamento e alla tratta.',
                'charityContain2': 'Alle amache gialle crediamo che la creazione di posti di lavoro etica sia una soluzione a lungo termine a lungo termine alla povertà estrema.',
                'charityContain3': 'Invece di organizzare un patchwork di donazioni di beneficenza per fornire acqua, nutrizione, abbigliamento, ecc., Stiamo lavorando direttamente con le famiglie per costruire una strategia completa, dignitosa e a lungo termine verso un futuro più luminoso. Le cause alla base della povertà sistemica sono complicate, ma la stabilità finanziaria a lungo termine è a portata di mano.',
                'charityContain4': 'Per dirla semplicemente: concentrandoci sul sostentamento, possiamo ritagliare l\'uomo di mezzo, ottenere denaro direttamente nelle mani di madri intelligenti + intraprendenti e consentire alle famiglie di affrontare i propri problemi (senza essere soggetti all\'agenda di chiunque altro).',
                'charityContain5': 'In tre comunità di tessitura, stiamo lavorando per creare posti di lavoro per le madri e costruire una base per una trasformazione positiva della comunità. Attraverso un lavoro di tessitura flessibile e sicuro per la \"prosperità\", i nostri artigiani sono in grado di sollevare le loro famiglie dalla povertà e dalla schiavitù del debito alla classe media.',
                'charityContain6': '** La creazione di posti di lavoro per le donne è particolarmente importante per la trasformazione della comunità: la ricerca mostra che le donne spenderanno fino al 90% dei loro guadagni in materia di salute, alimentazione e istruzione delle loro famiglie. Trasformare le donne in capofamiglia migliora il loro status nella comunità, costruisce l\'autostima e consente loro di raggruppare le risorse per migliorare le infrastrutture.',
