                'howToReturnTitle': 'Come tornare',
                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Gli articoli devono essere restituiti nonno, non danneggiati e inutilizzati, con tutti i tag collegati e l\'imballaggio originale incluso.',
                'returnPolicyContain3': 'Le calzature e gli accessori devono essere restituiti con le scatole e i sacchetti di polvere di marca originali, dove forniti e collocati all\'interno di una scatola esterna protettiva per la spedizione.',
                'returnPolicyContain4': 'Quando provi le calzature, si prega di fare attenzione a non contrassegnare le suole o danneggiare la scatola delle scarpe.',
                'returnPolicyContain5': 'Se un articolo ha un tag di sicurezza avorchic o un tag del marchio allegato, deve essere restituito con il tag nel suo originale.',
                'returnPolicyContain6': 'I prodotti di bellezza e cosmetici devono essere restituiti non aperti e inutilizzati, con i sigilli di qualsiasi imballaggio ancora intatti.',
                'returnPolicyContain7': 'Gli articoli per calze, lingerie e costumi da bagno devono essere restituiti con i sigilli di igiene attaccati e in imballaggi di prodotti non aperti e non danneggiati, ove applicabile.',
                'returnPolicyContain8': 'Lingerie e costumi da bagno devono essere provati solo sui tuoi indumenti intimi. Non accetteremo alcun rendimento che sono stati indossati o sporchi.',
                'returnPolicyContain9': 'Le maschere per il viso devono essere restituite nonno nella loro confezione di prodotti originale, non aperta e non danneggiata. I gioielli devono essere restituiti nelle stesse condizioni in cui è arrivato, compresi tutti gli imballaggi con marchio e i documenti forniti.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Se hai effettuato un ordine come ospite, puoi iniziare il tuo ritorno qui. Per restituire o annullare un articolo che è stato realizzato alle tue specifiche, visualizzare la nostra sezione \"articoli personalizzati\" di seguito per ulteriori informazioni.',
                'aboutUsText': 'Chi siamo',
                'aboutUsTitle': 'Siamo marchi ed etichette',
                'aboutUsContain': 'Esplora i migliori marchi dei 100 anni',
                'aboutUsContain1': 'Brands & Labels è una delle migliori destinazioni di moda di lusso online con 5 milioni di visitatori al mese e spedizione in tutto il mondo.',
                'aboutUsContain2': 'Il sito Web presenta la migliore selezione dei migliori designer affermati e giovani talenti emergenti. Brandslabels è stata fondata a Firenze nei primi anni \'30, con l\'apertura dell\'omonimo concept store dell\'azienda su Via Roma. Online Dal 1999, l\'azienda attribuisce il 90% delle entrate totali alle vendite online. Fino ad oggi rimane un\'azienda di famiglia di proprietà privata al 100%, con il nipote del fondatore, Andrea Panconesi che agisce come CEO e sua figlia, Annagreta Panconesi come direttore creativo.',
                'aboutUsContain3': 'Il sito offre una vasta selezione di abbigliamento, scarpe, borse, accessori, interni e bellezza di lusso, con prodotti disponibili per uomini, donne e bambini dei più prestigiosi designer come Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus e altri.',
                'aboutUsContain4': 'Attualmente ci sono 200 persone provenienti da 15 paesi diversi che lavorano per produrre e mantenere marchi. Il sito è disponibile in 9 lingue: inglese, italiano, tedesco, cinese, russo, spagnolo, francese, coreano e giapponese. Il sito è creato interamente internamente, con i dipartimenti grafici di Florence Office Housing, IT, servizio clienti, marketing e acquisto. Gli stilisti e i team di stampa operano dall\'ufficio delle brandslabel nella capitale della moda del mondo - Milano.',
                'aboutUsContain5': 'Tutti gli ordini vengono spediti in tutto il mondo dalla sede delle etichette dei marchi in scatole che vengono preparate con la massima cura e usano i materiali migliori, dalle borse da scarpe firmate al nastro personalizzato.',
                'aboutUsContain6': 'Brandslabels ha avuto 1,5 milioni di visitatori unici di accesso al sito nel 2008 ed è cresciuto fino a 53 milioni di visitatori unici nel 2017. Più del 15% delle vendite online sono generate dagli Stati Uniti, seguito da Germania, Regno Unito, Italia, Cina e Francia.',
                'aboutUsContain7': 'Brandslabels spinge i confini del paesaggio al dettaglio di lusso sia su e offline con una serie di servizi esclusivi e iniziative di marchio tra cui Buy It First, Luxury Club, Sneakers Club, LVR Privilege e LVR Editions.',
