                'charityTitlesolo': 'Sperare',
                'charityContain1solo': 'Quando acquisti da noi, aiuti a sostenere un sogno un sogno per dare a un futuro sicuro un ambiente felice e una vita sana.',
                'charityContain2solo': 'Hope è il nostro progetto per dare speranza e opportunità a coloro che ne hanno più bisogno. Ogni dollaro che spendi sul nostro sito - aiuta a migliorare una vita da qualche parte, dai rifugiati siriani all\'educazione dei bambini in Africa o a fornire acqua pulita, desideriamo e speriamo di rendere il mondo un posto più uguale.',
                'charityContain3solo': 'Il 2% di ogni vendita effettuata sul nostro sito Web va ad aiutare i più bisognosi. Puoi anche scegliere di contribuire con qualsiasi ulteriore importo che corrisponderemo oltre al nostro 2%, fino a un massimo del 5% del valore dell\'ordine.',
                'charityContain4solo': 'Cosa c\'è di più? Vieni aggiornato da noi sulla donazione in tutti i dettagli possibili e sai dove sono stati spesi i soldi e come ha contribuito a cambiare una vita.',
                'grandTotalToBeCharge': 'Grande totale da addebitare:',
