                'returnPolicyTitlesolo': 'TERMINI DI RESTITUZIONE',
                'returnPolicyContain2solo': '1. Items must be returned unworn, undamaged and unused, with all tags attached and the original packaging included.',
                'returnPolicyContain3solo': '2. Footwear and accessories must be returned with the original branded boxes and dust bags, where provided, and placed inside a protective outer box for shipping.',
                'returnPolicyContain4solo': '3. When trying on footwear, please take care not to mark the soles or damage the shoe box.',
                'returnPolicyContain5solo': '4. If an item has a Avoirchic security tag or brand tag attached, it must be returned with the tag in its original.',
                'returnPolicyContain6solo': '5. Beauty and cosmetic products must be returned unopened and unused, with the seals of any packaging still intact.',
                'returnPolicyContain7solo': '6. Hosiery, lingerie and swimwear items must be returned with the hygiene seals attached and in unopened and undamaged product packaging, where applicable.',
                'returnPolicyContain8solo': '7. Lingerie and swimwear must only be tried on over your own undergarments. We will not accept any returns that have been worn or are soiled.',
                'returnPolicyContain9solo': '8. Face masks must be returned unworn in their original, unopened and undamaged product packaging.',
                'returnPolicyContain12': '9. I gioielli devono essere restituiti nelle stesse condizioni in cui è arrivato, compresi tutti gli imballaggi con marchio e i documenti forniti.',
                'aboutUsContain1solo': 'Solo è una delle migliori destinazioni online di lusso con 5 milioni di visitatori al mese e spedizione in tutto il mondo.',
                'aboutUsContain2solo': 'Il sito Web presenta la migliore selezione di designer affermati e anche giovani talenti emergenti. Solo è stata fondata a Firenze nei primi anni \'30, con l\'apertura dell\'omonimo concept store dell\'azienda su via Roma.Online Dal 1999, l\'azienda attribuisce il 90% delle entrate totali alle vendite online. Fino ad oggi rimane un\'azienda di famiglia di proprietà privata al 100%, con il nipote del fondatore, Andrea Panconesi che agisce come CEO e sua figlia, Annagreta Panconesi come direttore creativo.',
                'aboutUsContain3solo': 'Il sito offre una vasta selezione di abbigliamento, scarpe, borse, accessori, interni di case di lusso e bellezza, con prodotti disponibili per uomini, donne e bambini dei più prestigiosi designer come Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus e altri.',
                'aboutUsContain4solo': 'Attualmente ci sono 200 persone provenienti da 15 paesi diversi che lavorano per produrre e mantenere da solo. Il sito è disponibile in 9 lingue: inglese, italiano, tedesco, cinese, russo, spagnolo, francese, coreano e giapponese. Il sito è creato interamente internamente, con i dipartimenti grafici di Florence Office Housing, IT, servizio clienti, marketing e acquisto. Gli stilisti e i team di stampa operano dall\'ufficio solista nella capitale della moda del mondo - Milano.',
                'aboutUsContain5solo': 'Tutti gli ordini vengono spediti in tutto il mondo dalla sede solista in scatole che vengono preparate con la massima cura e usano i materiali migliori, dalle sacche di scarpe firmate al nastro personalizzato.',
                'aboutUsContain6solo': 'Solo ha avuto 1,5 milioni di visitatori unici di accesso al sito nel 2008 ed è cresciuto fino a 53 milioni di visitatori unici nel 2017. Più del 15% delle vendite online sono generate dagli Stati Uniti, seguito da Germania, Regno Unito, Italia, Cina e Francia.',
                'aboutUsContain7solo': 'Solo spinge i confini del paesaggio al dettaglio di lusso sia su e offline con una serie di servizi esclusivi e iniziative di marchio tra cui Buy It First, Luxury Club, Sneakers Club, LVR Privilege e LVR Editions.',
