                'charityTitleveralusso': 'Il tuo unico acquisto può cambiare una vita.',
                'charityContain1veralusso': 'Veralusso - funziona attivamente per aiutare a cambiare il mondo e ogni acquisto che fai sul nostro sito - ci aiuta a fare lo stesso. Abbiamo collaborato con alcune organizzazioni benefiche e vorremmo che i tuoi suggerimenti aggiungano le organizzazioni benefiche e le cause che ritieni abbiano bisogno del nostro aiuto e di quelli che possono fare la differenza per la vita delle persone.',
                'charityContain2veralusso': 'Stimato 11 milioni di bambini sotto i 5 anni affrontano fame estreme o fame in tutto il mondo.',
                'charityContain3veralusso': 'I casi di anziani abbandonati sono in aumento in tutto il mondo. La paura di essere un peso deve finire.',
