                'getText': 'Erhalten',
                'charityTitle': 'Positive Impact + Sustainability',
                'charityContain1': 'Noch immer leben mehr als eine Milliarde Menschen auf der ganzen Welt in extremer Armut mit weniger als 1,25 US-Dollar pro Tag. Allein in Thailand leben mehr als eine Million Angehörige von Bergstämmen am Rande der Gesellschaft – ihnen wird die Staatsbürgerschaft verweigert, sie sind vom formellen Arbeitsmarkt ausgeschlossen und anfällig für Ausbeutung und Menschenhandel.',
                'charityContain2': 'Bei Yellow Leaf Hängematten glauben wir, dass die Schaffung von ethischen Arbeitsplätzen eine ermächtigende langfristige Lösung für extreme Armut ist.',
                'charityContain3': 'Anstatt ein Flickenteppich von gemeinnützigen Spenden zu organisieren, um Wasser, Ernährung, Kleidung usw. bereitzustellen, arbeiten wir direkt mit Familien zusammen, um eine umfassende, würdige und langfristige Strategie für eine bessere Zukunft aufzubauen. Die Ursachen hinter systemischer Armut sind kompliziert, aber langfristige finanzielle Stabilität ist in Reichweite.',
                'charityContain4': 'Um es einfach auszudrücken: Indem wir uns auf den Lebensunterhalt konzentrieren, können wir den mittleren Mann ausschneiden, Geld direkt in die Hände von Smart + einfallsreichen Müttern bringen und Familien befähigen, ihre eigenen Probleme anzugehen (ohne der Agenda eines anderen anderen zu unterliegen).',
                'charityContain5': 'In drei Webgemeinschaften arbeiten wir daran, Arbeitsplätze für Mütter zu schaffen und eine Grundlage für eine positive Gemeinschaftsumwandlung aufzubauen. Durch flexible, sichere „Wohlstandslohn“ -Webenarbeit können unsere Handwerker ihre Familien von Armut und Schuldensklaverei in die Mittelschicht heben.',
                'charityContain6': '** Die Schaffung von Arbeitsplätzen für Frauen ist besonders wichtig für die Transformation der Gemeinschaft - Untersuchungen zeigen, dass Frauen bis zu 90% ihres Einkommens für die Gesundheit, Ernährung und Bildung ihrer Familien ausgeben werden. Das Umwandeln von Frauen in Ernährer verbessert ihren Status in der Gemeinde, baut Selbstwertgefühl auf und ermöglicht es ihnen, Ressourcen zu bündeln, um die Infrastruktur zu verbessern.',
