                'howToReturnTitle': 'Wie man zurückkommt',
                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Die Elemente müssen ungetragen, unbeschädigt und unbenutzt zurückgegeben werden, wobei alle Tags und die Originalverpackung enthalten sind.',
                'returnPolicyContain3': 'Schuhe und Accessoires müssen mit den ursprünglichen Markenkästen und Staubbeuteln zurückgegeben werden, wo sie zur Verfügung gestellt und in eine schützende Außenschachtel für den Versand gelegt werden.',
                'returnPolicyContain4': 'Achten Sie beim Anprobieren von Schuhen bitte darauf, die Sohlen zu markieren oder den Schuhkarton zu beschädigen.',
                'returnPolicyContain5': 'Wenn ein Artikel über ein Avoirchic -Sicherheits -Tag oder ein Marken -Tag beigefügt ist, muss es mit dem Tag in seinem Original zurückgegeben werden.',
                'returnPolicyContain6': 'Schönheits- und kosmetische Produkte müssen ungeöffnet und unbenutzt zurückgegeben werden, wobei die Dichtungen jeder Verpackung noch intakt sind.',
                'returnPolicyContain7': 'Gemüse, Dessous- und Badebekleidungspunkte müssen mit den angeschlossenen Hygienendichtungen und gegebenenfalls in ungeöffneten und unbeschädigten Produktverpackungen zurückgegeben werden.',
                'returnPolicyContain8': 'Dessous und Badebekleidung dürfen nur über Ihre eigenen Unterwäsche ausprobiert werden. Wir werden keine Renditen akzeptieren, die getragen oder verschmutzt wurden.',
                'returnPolicyContain9': 'Gesichtsmasken müssen in ihrer ursprünglichen, ungeöffneten und unbeschädigten Produktverpackung ungetragen zurückgegeben werden. Der Schmuck muss in dem gleichen Zustand zurückgegeben werden, in dem er angekommen ist, einschließlich aller Markenverpackungen und Dokumente.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Wenn Sie als Gast eine Bestellung aufgeben, können Sie Ihre Rücksendung hierher beginnen. Um einen Artikel zurückzugeben oder zu stornieren, der zu Ihren Spezifikationen hergestellt wurde, finden Sie weiter unten unseren Abschnitt „Customized Elements“ für weitere Informationen.',
                'aboutUsText': 'Über uns',
                'aboutUsTitle': 'Wir sind Brand & Etiketten',
                'aboutUsContain': 'Entdecken Sie 100 der besten Marken der Welten',
                'aboutUsContain1': 'Brands & Labels ist ein Top -Online -Luxus -Modeziel mit 5 Millionen Besuchern pro Monat und weltweiter Versand.',
                'aboutUsContain2': 'Die Website bietet die beste Auswahl der besten etablierten Designer sowie junge aufstrebende Talente. Brandslabels wurde in den frühen 1930er Jahren in Florenz gegründet und eröffnete den gleichnamigen Konzeptgeschäft des Unternehmens über die über Roma. Seit 1999 legt das Unternehmen 90% des Gesamtumsatzes dem Online -Umsatz zurück. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Gründers fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain3': 'Die Website bietet eine große Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxus-Heiminnenräumen und Schönheit mit Produkten für Männer, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain4': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Ländern, in denen Markenlabel produziert und gewartet werden. Die Website ist in 9 Sprachen erhältlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Französisch, Koreanisch und Japanisch. Die Website wird vollständig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Brandslabels -Büro in der Modehauptstadt der Welt - Mailand.',
                'aboutUsContain5': 'Alle Bestellungen werden weltweit vom Hauptquartier der Brands -Etiketten in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die besten Materialien verwenden, von den typischen Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain6': 'Brandslabels hatte 2008 1,5 Millionen Besucher auf das Gelände und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkäufe werden aus den USA generiert, gefolgt von Deutschland, Großbritannien, Italien, China und Frankreich.',
                'aboutUsContain7': 'Brandslabels überschreitet die Grenzen der Luxus -Einzelhandelslandschaft sowohl in als auch offline mit einer Reihe exklusiver Dienstleistungen und Markeninitiativen, darunter Buy It First, Luxury Club, Sneakers Club, LVR Privilege und LVR -Editionen.',
