                'positiveImpactSustainability': 'Positive Auswirkungen + Nachhaltigkeit',
                'thereAreStillMoreThanMSG': 'Es gibt immer noch mehr als eine Milliarde Menschen auf der ganzen Welt, die in extremer Armut mit weniger als 1,25 US -Dollar pro Tag leben. Allein in Thailand existieren mehr als eine Million Mitglieder von Hill -Stämmen am Rande der Gesellschaft - die Staatsbürgerschaft verweigert, aus dem formellen Arbeitsmarkt ausgeschlossen und anfällig für Ausbeutung und Handel.',
                'atYellowLeafHammocksMsg': 'Bei Yellow Leaf Hängematten glauben wir, dass die Schaffung von ethischen Arbeitsplätzen eine ermächtigende langfristige Lösung für extreme Armut ist.',
                'insteadOfOrganizingMsg': 'Anstatt ein Flickenteppich von gemeinnützigen Spenden zu organisieren, um Wasser, Ernährung, Kleidung usw. bereitzustellen, arbeiten wir direkt mit Familien zusammen, um eine umfassende, würdige und langfristige Strategie für eine bessere Zukunft aufzubauen. Die Ursachen hinter systemischer Armut sind kompliziert, aber langfristige finanzielle Stabilität ist in Reichweite.',
                'toPutItSimplyMsg': 'Um es einfach auszudrücken: Indem wir uns auf den Lebensunterhalt konzentrieren, können wir den mittleren Mann ausschneiden, Geld direkt in die Hände von Smart + einfallsreichen Müttern bringen und Familien befähigen, ihre eigenen Probleme anzugehen (ohne der Agenda eines anderen anderen zu unterliegen).',
                'acrossThreeWeavingCommunitiesMsg': 'In drei Webgemeinschaften arbeiten wir daran, Arbeitsplätze für Mütter zu schaffen und eine Grundlage für eine positive Gemeinschaftsumwandlung aufzubauen. Durch flexible, sichere „Wohlstandslohn“ -Webenarbeit können unsere Handwerker ihre Familien von Armut und Schuldensklaverei in die Mittelschicht heben.',
                'creatingJobsForWomenMsg': '** Die Schaffung von Arbeitsplätzen für Frauen ist besonders wichtig für die Transformation der Gemeinschaft - Untersuchungen zeigen, dass Frauen bis zu 90% ihres Einkommens für die Gesundheit, Ernährung und Bildung ihrer Familien ausgeben werden. Das Umwandeln von Frauen in Ernährer verbessert ihren Status in der Gemeinde, baut Selbstwertgefühl auf und ermöglicht es ihnen, Ressourcen zu bündeln, um die Infrastruktur zu verbessern.',
                'theFoundationForABrighterFuter': 'Die Grundlage für einen helleren Fvere',
                'theSecurityOfAStableMsg': 'Die Sicherheit einer stabilen, wachsenden Einnahmequelle hatte einen enormen Einfluss auf das Dorf. Die MLABRI konnten eine Schule gründen und ein Gemeindezentrum zum Weben und Geselligkeit aufbauen. Sie gründeten eines der ersten Arbeitslosenfonds Thailands. Mit zunehmender wirtschaftlicher Macht setzten sie sich erfolgreich für Staatsbürgerschaft und Bürgerrechte ein, die sie erstmals 2001 gewährt haben. Das Hängemattenweben ist eine flexible Arbeit, ideal für Mütter, die von zu Hause aus arbeiten und ihre eigenen Zeitpläne erstellen können. Leider beschränkte sich ohne Zugang zu den globalen Märkten die Nachfrage nach Hängematten auf die thailändische Tourismussaison, und es gab keine Möglichkeit, das ganze Jahr über eine Beschäftigung zu gewährleisten.',
                'spreadingLastingChangeTheHammockRrevolution': 'Verbreitung dauerhafter Veränderung: Die Hängematten -Entfernung',
                'thisIsAboutWhereMsg': 'Hier geht es darum, wo das gelbe Blatt der Geschichte verbindet! In den letzten Jahren haben wir daran gearbeitet, konsistente Vertriebskanäle zu entwickeln, internationale Partnerschaften aufzubauen und den Betrieb in den Dörfern zu stabilisieren.',
                'corollaryEconomicMsg': 'Wirtschaftliche Möglichkeiten, wie ein Postamt, die Zubereitung von Speisen und eine nachhaltige Kaffeezucht, haben diejenigen, die nicht weben, eingebrochen. Unsere Partnerschaft mit Kiva hat die Finanzausbildung und die Finanzplanung angeregt. Viele Weber eröffnen zum ersten Mal in ihrem Leben Bankkonten!',
                'wWithOurGrowthMsg': 'Da unser Wachstum weiterhin beschleunigt wird, werden wir nicht nur das ganze Jahr über alle Mlabri-Weavers einsetzen, sondern auch in der Lage sein, weiter zu expandieren und Schulungen und eine kontinuierliche Beschäftigung für die Gemeinden der Hill-Stammes in der umliegenden Region anzubieten. Bis zum Weben von Arbeiten und nachhaltigen Arbeitsplätzen im gesamten Gebiet verfügbar sind, werden destruktive landwirtschaftliche Praktiken fortgesetzt und der ausbeuterische Zyklus der indentierten Knechtschaft wird nicht wirklich enden.',
                'throughTheEstablishmentMsg': 'Durch die Einrichtung von Yellow Leaf als globale Lifestyle -Marke wird die Hill Tribe -Dörfer, mit denen wir zusammenarbeiten, diese positiven Auswirkungen aufrechterhalten und weiterhin die Grundlage für eine bessere Zukunft legen.',
