                'appidsuv': 'SUV',
                'appNameTextsuv': 'SUV & Nat',
                'charityTitlesuv': 'Kaufen Sie bewusster ein',
                'charityContain1suv': 'Jeder Kauf, den Sie tätigen, hilft Buld der Zukunft eines Kindes.',
                'charityContain2suv': 'Sun & Nat - arbeitet aktiv, um die Welt zu verändern, und jeder Kauf, den Sie auf unserer Website tätigen, hilft uns, dasselbe zu tun. Wir haben uns mit ein paar Wohltätigkeitsorganisationen zusammengetan und möchten, dass Ihre Vorschläge die Wohltätigkeitsorganisationen und Ursachen hinzufügen, die Sie für unsere Hilfe und diejenigen brauchen, die für das Leben der Menschen einen Unterschied machen können.',
                'charityContain3suv': 'Sun & Nat spendet 3% des Erlöses für jeden Verkauf an eine von Ihnen ausgewählte Wohltätigkeitsorganisation oder an eine auf unserer Liste, wenn Sie keine auswählen. Sie können bei der Kasse weiter helfen, einen zusätzlichen Betrag zu spenden.',
                'charityContain4suv': 'Wenn Sie 10 Dollar hinzufügen möchten, werden wir weitere 10 Dollar als unseren Beitrag zu unseren ersten 3% (vorbehaltlich von maximal 10% des Bestellwerts) hinzufügen.',
                'charityContain5suv': 'Jeder Cent wird berücksichtigt und unser Team arbeitet hart, um sicherzustellen, dass das Geld in den richtigen Händen reicht.',
                'charityContain6suv': 'Wir aktualisieren Sie jeden Schritt des Weges, damit Sie zufrieden sein können, wenn sich Ihre Beiträge verändert und das Leben verbessert haben.',
                'returnProcessTitlesuv': 'Rückgabeprozess',
                'aboutUsTitlesuv': 'SUV & NAT ist ein Top -Online -Luxus -Modeziel mit 5 Millionen Besuchern pro Monat und weltweit Versand.',
                'aboutUsContainsuv': 'Die Website bietet die beste Auswahl der besten etablierten Designer sowie junge aufstrebende Talente. Brandslabels wurde in den frühen 1930er Jahren in Florenz gegründet und eröffnete den gleichnamigen Konzeptgeschäft des Unternehmens über die über Roma. Seit 1999 legt das Unternehmen 90% des Gesamtumsatzes dem Online -Umsatz zurück. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Gründers fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain1suv': 'Die Website bietet eine große Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxus-Heiminnenräumen und Schönheit mit Produkten für Männer, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain2suv': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Ländern, in denen Markenlabel produziert und gewartet werden. Die Website ist in 9 Sprachen erhältlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Französisch, Koreanisch und Japanisch. Die Website wird vollständig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Büro von Suvandnats in der Modeladung der Welt - Mailand.',
                'aboutUsContain3suv': 'Alle Bestellungen werden weltweit aus dem Hauptquartier von Suvandnats in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die besten Materialien verwenden, von den typischen Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain4suv': 'Suvandnats hatte 2008 1,5 Millionen Besucher auf das Gelände und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkäufe werden aus den USA generiert, gefolgt von Deutschland, Großbritannien, Italien, China und Frankreich.',
                'aboutUsContain5suv': 'Suvandnats überschreitet die Grenzen der Luxus -Einzelhandelslandschaft sowohl in als auch offline mit einer Reihe exklusiver Dienstleistungen und Markeninitiativen, darunter Buy It First, Luxury Club, Sneakers Club, LVR Privilege und LVR -Editionen.',
