                'charityTitlesolo': 'Hoffnung',
                'charityContain1solo': 'Wenn Sie bei uns kaufen, helfen Sie dabei, einen Traum zu unterstützen, einer sicheren Zukunft ein glückliches Umfeld und ein gesundes Leben zu geben.',
                'charityContain2solo': 'Hoffnung ist unser Projekt, um denjenigen, die es am meisten brauchen, Hoffnung und Möglichkeiten zu geben. Jeder Dollar, den Sie auf unserer Website ausgeben - hilft, ein Leben irgendwo zu verbessern, von syrischen Flüchtlingen bis hin zur Erziehung von Kindern in Afrika oder zur Bereitstellung sauberer Wasser, wir wünschen uns, die Welt zu einem gleichen Ort zu machen.',
                'charityContain3solo': '2% aller auf unserer Website getätigten Verkaufsanlagen helfen den Bedürftigen, die am meisten bedürftig sind. Sie können sich auch dafür entscheiden, einen weiteren Betrag beizutragen, den wir zusätzlich zu unseren 2% bis maximal 5% des Bestellwerts übereinstimmen.',
                'charityContain4solo': 'Was ist mehr? Sie werden von uns über die Spende in allen möglichen Details aktualisiert und wissen, wo das Geld ausgegeben wurde und wie es dazu beigetragen hat, ein Leben zu verändern.',
