                'returnPolicyTitlesolo': 'RÜCKGABERECHT',
                'returnPolicyContain2solo': '1. Items must be returned unworn, undamaged and unused, with all tags attached and the original packaging included.',
                'returnPolicyContain3solo': '2. Footwear and accessories must be returned with the original branded boxes and dust bags, where provided, and placed inside a protective outer box for shipping.',
                'returnPolicyContain4solo': '3. When trying on footwear, please take care not to mark the soles or damage the shoe box.',
                'returnPolicyContain5solo': '4. If an item has a Avoirchic security tag or brand tag attached, it must be returned with the tag in its original.',
                'returnPolicyContain6solo': '5. Beauty and cosmetic products must be returned unopened and unused, with the seals of any packaging still intact.',
                'returnPolicyContain7solo': '6. Hosiery, lingerie and swimwear items must be returned with the hygiene seals attached and in unopened and undamaged product packaging, where applicable.',
                'returnPolicyContain8solo': '7. Lingerie and swimwear must only be tried on over your own undergarments. We will not accept any returns that have been worn or are soiled.',
                'returnPolicyContain9solo': '8. Face masks must be returned unworn in their original, unopened and undamaged product packaging.',
                'returnPolicyContain12': '9. Schmuck muss in dem gleichen Zustand zurückgegeben werden, in dem er angekommen ist, einschließlich aller Markenverpackungen und Dokumente, die damit zur Verfügung stehen.',
                'aboutUsContain1solo': 'Solo ist ein Top -Online -Luxuryfashion -Ziel mit 5 Millionen Besuchern pro Monat und weltweit Versand.',
                'aboutUsContain2solo': 'Die Website bietet die beste Auswahl an thetop etablierten Designern und jungen aufstrebenden Talenten. Solo wurde in den frühen 1930er Jahren in Florenz gegründet, wobei das Unternehmen seit 1999 den gleichnamigen Concept Store für Via Roma.online eröffnet. Das Unternehmen führt 90% des Gesamtumsatzes auf Online -Verkäufe zu. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Gründers fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain3solo': 'Die Website bietet eine große Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxushome-Innenräumen und Schönheit, mit Produkten für Männer, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain4solo': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Ländern, in denen Solo produziert und aufrechterhalten wird. Die Website ist in 9 Sprachen erhältlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Französisch, Koreanisch und Japanisch. Die Website wird vollständig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Solo -Büro in der Modeladung der Welt - Mailand.',
                'aboutUsContain5solo': 'Alle Bestellungen werden weltweit aus dem Solo -Hauptquartier in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die feinsten Materialien verwenden, von den Signature -Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain6solo': 'Solo hatte im Jahr 2008 1,5 Millionen eindeutige Besucher auf das Gelände und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkäufe werden aus den USA generiert, gefolgt von Deutschland, Großbritannien, Italien, China und Frankreich.',
                'aboutUsContain7solo': 'Solo überschreitet die Grenzen der Luxus -Einzelhandelslandschaft sowohl im als auch offline mit einer Reihe exklusiver Dienstleistungs- und Markeninitiativen, darunter Kaufen Sie First, Luxury Club, Sneakers Club, LVR -Privilegien und LVR -Editionen.',
