                'weAimToSatisfyText': 'Wir wollen unsere Kunden zu 100% befriedigen, aber Online -Shopping ist mit Risiken behaftet, insbesondere wenn es um den internationalen Versand geht. Um Ihnen die Sicherheit zu geben, wenn Sie bei uns einkaufen, haben wir Paypal und Checkout.com zusammengearbeitet, um Ihnen vollständige Sicherheit zu geben und Sicherheit bei Ihren Einkäufen.',
