                'dontWorryLetUsKnowByClickingText': 'Mach dir keine Sorgen, lass uns wissen, indem wir hier klicken und wir unser Kundenunterstützungsteam den Unterschied zurückerstattet, ob der Kauf innerhalb der letzten 30 Tage getätigt wurde.',
