                'appidveralusso': 'Veralusso',
                'charityTitleveralusso': 'Ihr einziger Kauf kann ein Leben verändern.',
                'charityContain1veralusso': 'Veralusso - arbeitet aktiv, um die Welt zu verändern, und jeder Kauf, den Sie auf unserer Website tätigen - hilft uns, dasselbe zu tun. Wir haben uns mit ein paar Wohltätigkeitsorganisationen zusammengetan und möchten, dass Ihre Vorschläge die Wohltätigkeitsorganisationen und Ursachen hinzufügen, die Sie für unsere Hilfe und diejenigen brauchen, die für das Leben der Menschen einen Unterschied machen können.',
                'charityContain2veralusso': 'Schätzungsweise 11 Millionen Kinder unter 5 Jahren sind weltweit extremer Hunger oder Hunger ausgesetzt.',
                'charityContain3veralusso': 'Fälle von verlassenen älteren Menschen sind weltweit auf dem Vormarsch. Die Angst, eine Last zu sein, muss enden.',
                'charityContain4veralusso': 'Jährliche Statistik. Ungefähr 7,6 Millionen Tiere betreten landesweit ein Tierheim. Ungefähr 2,7 Millionen Tierpfleger werden eingeschläfert. Es werden nur rund 2,7 Millionen Tierheimtiere adoptiert.',
                'charityContain5veralusso': 'Veralusso spendet 3% des Erlöses für jeden Verkauf an eine von Ihnen ausgewählte Wohltätigkeitsorganisation oder an eine in unserer Liste, wenn Sie keine auswählen. Sie können weiterhin bei der Spende eines zusätzlichen Betrags an der Kasse helfen. Wenn Sie 10 Dollar hinzufügen, werden wir weitere 10 Dollar als weiteren Beitrag zu unseren ersten 3% (vorbehaltlich von maximal 10% des Bestellwerts) hinzufügen.',
                'charityContain6veralusso': 'Jeder Cent wird berücksichtigt und unser Team arbeitet hart, um sicherzustellen, dass das Geld die richtigen Hände erreicht.',
                'charityContain7': 'Wir aktualisieren Sie jeden Schritt des Weges, damit Sie zufrieden sein können, wenn sich Ihre Beiträge verändert und das Leben verbessert haben.',
