                'charityTitle': 'Positive Impact + Sustainability',
                'charityContain1': 'Il y a encore plus d\'un milliard de personnes dans le monde qui vivent dans l\'extrême pauvreté avec moins de \$1,25 par jour. Rien qu\'en Thaïlande, plus d\'un million de membres des tribus montagnardes vivent en marge de la société - privés de citoyenneté, exclus du marché du travail formel et vulnérables à l\'exploitation et à la traite.',
                'charityContain2': 'Chez Yellow Leaf Hamacs, nous pensons que la création d\'emplois éthique est une solution à long terme stimulante à l\'extrême pauvreté.',
                'charityContain3': 'Au lieu d\'organiser un patchwork de dons de bienfaisance pour fournir de l\'eau, de la nutrition, des vêtements, etc., nous travaillons directement avec les familles pour construire une stratégie complète, digne et à long terme vers un avenir meilleur. Les causes derrière la pauvreté systémique sont compliquées, mais la stabilité financière à long terme est à portée de main.',
                'charityContain4': 'Pour le dire simplement: en nous concentrant sur les moyens de subsistance, nous pouvons couper l\'homme du milieu, mettre de l\'argent directement entre les mains de mères intelligentes + ingénieuses et permettre aux familles de s\'attaquer à leurs propres problèmes (sans être soumis à l\'ordre du jour de quelqu\'un d\'autre).',
                'charityContain5': 'Dans trois communautés de tissage, nous travaillons à créer des emplois pour les mères et à construire une base pour une transformation de la communauté positive. Grâce à un travail de tissage flexible et sûr de «salaire de prospérité», nos artisans sont capables de lever leur famille de la pauvreté et de l\'esclavage de la dette à la classe moyenne.',
                'charityContain6': '** Créer des emplois pour les femmes est particulièrement important pour la transformation de la communauté - la recherche montre que les femmes dépenseront jusqu\'à 90% de leurs gains sur la santé, la nutrition et l\'éducation de leur famille. Transformer les femmes en soutiens de famille améliore leur statut dans la communauté, renforce l\'estime de soi et leur permet de mettre en commun les ressources pour améliorer les infrastructures.',
