                'howToReturnTitle': 'Comment revenir',
                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Les articles doivent être retournés non portés, intacts et inutilisés, avec toutes les balises attachées et l\'emballage d\'origine inclus.',
                'returnPolicyContain3': 'Les chaussures et les accessoires doivent être retournés avec les boîtes de marque et les sacs à poussière d\'origine, où sont fournies, et placées dans une boîte extérieure protectrice pour l\'expédition.',
                'returnPolicyContain4': 'Lorsque vous essayez des chaussures, veuillez prendre soin de ne pas marquer les plants ou endommager la boîte à chaussures.',
                'returnPolicyContain5': 'Si un élément a une balise de sécurité ou une balise de marque Avoirchic, elle doit être retournée avec la balise dans son original.',
                'returnPolicyContain6': 'La beauté et les produits cosmétiques doivent être retournés sans ouverture et inutilisés, les sceaux de tout emballage encore intact.',
                'returnPolicyContain7': 'Les articles de la bonneterie, de la lingerie et des maillots de bain doivent être retournés avec les joints d\'hygiène attachés et dans un emballage de produit non ouvert et non endommagé, le cas échéant.',
                'returnPolicyContain8': 'La lingerie et les maillots de bain ne doivent être essayés que sur vos propres sous-vêtements. Nous n\'accepterons aucun retour qui a été porté ou qui sera souillé.',
                'returnPolicyContain9': 'Les masques de visage doivent être retournés non portés dans leur emballage de produit original, non ouvert et non endommagé. Les bijoux doivent être retournés dans le même état dans lequel il est arrivé, y compris tous les emballages et documents de marque fournis avec lui.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Si vous avez passé une commande en tant qu\'invité, vous pouvez commencer votre retour ici. Pour retourner ou annuler un élément qui a été fait à vos spécifications, veuillez consulter notre section «Articles personnalisés» ci-dessous pour plus d\'informations.',
                'aboutUsText': 'À propos de nous',
                'aboutUsTitle': 'Nous sommes des marques et des étiquettes',
                'aboutUsContain': 'Explorez les centaines de meilleures marques du monde',
                'aboutUsContain1': 'Brands & Labels est une destination de mode de luxe en ligne avec 5 millions de visiteurs par mois et l\'expédition mondiale.',
                'aboutUsContain2': 'Le site Web présente la meilleure sélection des meilleurs designers établis ainsi que de jeunes talents émergents. Brandslabels a été fondée à Florence au début des années 1930, avec l\'ouverture du concept store éponyme de la société sur Via Roma. En ligne depuis 1999, la société attribue 90% du total des revenus aux ventes en ligne. À ce jour, il reste une entreprise familiale privée à 100%, avec le petit-fils du fondateur, Andrea Panonesi agissant en tant que PDG et sa fille, Annagreta Panconesi en tant que directrice créative.',
                'aboutUsContain3': 'Le site propose une large sélection de vêtements, de chaussures, de sacs, d\'accessoires, d\'intérieurs de maison de luxe et de beauté, avec des produits disponibles pour les hommes, les femmes et les enfants des designers les plus prestigieux tels que Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus et plus encore.',
                'aboutUsContain4': 'Il y a actuellement 200 personnes de 15 pays différents qui travaillent pour produire et maintenir des marques de marque. Le site est disponible en 9 langues: anglais, italien, allemand, chinois, russe, espagnol, français, coréen et japonais. Le site est créé entièrement en interne, avec la conception graphique de Florence Office, l\'informatique, le service client, le marketing et l\'achat. Les stylistes et les équipes de presse opèrent du bureau de Brandslabels dans la capitale de la mode du monde - Milan.',
                'aboutUsContain5': 'Toutes les commandes sont expédiées dans le monde entier du siège social des labels de marques dans des boîtes préparées avec un maximum de soins et utilisent les meilleurs matériaux, des sacs de chaussures signature au ruban personnalisé.',
                'aboutUsContain6': 'BrandsLabels comptait 1,5 million de visiteurs uniques accéder au site en 2008 et sont passés à 53 millions de visiteurs uniques en 2017. Plus de 15% des ventes en ligne sont générées à partir des États-Unis, suivis de l\'Allemagne, du Royaume-Uni, de l\'Italie, de la Chine et de la France.',
                'aboutUsContain7': 'Brandslabels repousse les limites du paysage de la vente au détail de luxe sur et hors ligne avec une gamme de services exclusifs et d\'initiatives de marque, notamment Buy It First, Luxury Club, Sneakers Club, LVR Privilege et LVR Editions.',
