                'category': 'Catégorie',
                'createNewTicket': 'Créer un nouveau billet',
                'positiveImpactSustainability': 'Impact positif + durabilité',
                'thereAreStillMoreThanMSG': 'Il y a encore plus d\'un milliard de personnes dans le monde vivant dans l\'extrême pauvreté avec moins de 1,25 \$ par jour. Rien qu\'en Thaïlande, plus d\'un million de membres des tribus Hill existent en marge de la société - nié citoyenneté, exclu du marché du travail officiel et vulnérable à l\'exploitation et à la traite.',
                'atYellowLeafHammocksMsg': 'Chez Yellow Leaf Hamacs, nous pensons que la création d\'emplois éthique est une solution à long terme stimulante à l\'extrême pauvreté.',
                'insteadOfOrganizingMsg': 'Au lieu d\'organiser un patchwork de dons de bienfaisance pour fournir de l\'eau, de la nutrition, des vêtements, etc., nous travaillons directement avec les familles pour construire une stratégie complète, digne et à long terme vers un avenir meilleur. Les causes derrière la pauvreté systémique sont compliquées, mais la stabilité financière à long terme est à portée de main.',
                'toPutItSimplyMsg': 'Pour le dire simplement: en nous concentrant sur les moyens de subsistance, nous pouvons couper l\'homme du milieu, mettre de l\'argent directement entre les mains de mères intelligentes + ingénieuses et permettre aux familles de s\'attaquer à leurs propres problèmes (sans être soumis à l\'ordre du jour de quelqu\'un d\'autre).',
                'acrossThreeWeavingCommunitiesMsg': 'Dans trois communautés de tissage, nous travaillons à créer des emplois pour les mères et à construire une base pour une transformation de la communauté positive. Grâce à un travail de tissage flexible et sûr de «salaire de prospérité», nos artisans sont capables de lever leur famille de la pauvreté et de l\'esclavage de la dette à la classe moyenne.',
                'creatingJobsForWomenMsg': '** Créer des emplois pour les femmes est particulièrement important pour la transformation de la communauté - la recherche montre que les femmes dépenseront jusqu\'à 90% de leurs gains sur la santé, la nutrition et l\'éducation de leur famille. Transformer les femmes en soutiens de famille améliore leur statut dans la communauté, renforce l\'estime de soi et leur permet de mettre en commun les ressources pour améliorer les infrastructures.',
                'theFoundationForABrighterFuter': 'La fondation pour un futur plus brillant',
                'theSecurityOfAStableMsg': 'La sécurité d\'une source de revenus stable et croissante a eu un impact énorme sur le village. Les Mlabri ont pu démarrer une école et construire un centre communautaire pour le tissage et la socialisation. Ils ont créé l\'un des premiers fonds de chômage de la Thaïlande. Avec une puissance économique accrue, ils ont réussi à faire pression pour la citoyenneté et les droits civils, qu\'ils ont été accordés pour la première fois en 2001. Le tissage de hamac est un travail flexible, idéal pour les mères qui peuvent travailler à domicile et faire leurs propres horaires. Malheureusement, sans accès aux marchés mondiaux, la demande de hamacs s\'est limitée à la saison du tourisme thaïlandais et il n\'y avait aucun moyen d\'assurer l\'emploi toute l\'année.',
                'spreadingLastingChangeTheHammockRrevolution': 'Répartir le changement durable: la rrévolution du hamac',
                'thisIsAboutWhereMsg': 'C\'est là où Yellow Leaf rejoint l\'histoire! Au cours des dernières années, nous avons travaillé pour développer des canaux de vente cohérents, établir des partenariats internationaux et stabiliser les opérations au sein des villages.',
                'corollaryEconomicMsg': 'Les opportunités économiques corollaires, comme un bureau de poste, la préparation des aliments et la culture durable du café ont vu le jour pour employer ceux qui ne sont pas tissés. Notre partenariat avec Kiva a stimulé une formation financière et une planification financière, de nombreux tisserands ouvrant des comptes bancaires pour la première fois de leur vie!',
                'wWithOurGrowthMsg': 'Avec notre croissance qui continue de s\'accélérer, nous serons non seulement en mesure d\'employer tous les tisserands MLABRI toute l\'année, mais nous pourrons également continuer à se développer et à fournir une formation et un emploi continu aux communautés de tribu des collines dans la région environnante. Jusqu\'à ce que les travaux de tissage et les emplois durables soient disponibles dans toute la région, les pratiques agricoles destructrices se poursuivront et le cycle d\'exploitation de la servitude sous contrat ne prendra pas vraiment fin.',
                'throughTheEstablishmentMsg': 'Grâce à la création de Yellow Leaf en tant que marque mondiale de style de vie, les villages Hill Tribe avec lesquels nous nous associons pourront soutenir cet impact positif et continuer à jeter les bases d\'un avenir meilleur.',
