                'appNameTextsuv': 'SUV et Nat',
                'charityTitlesuv': 'Acheter plus consciemment',
                'charityContain1suv': 'Chaque achat que vous effectuez aidera un avenir pour un enfant.',
                'charityContain2suv': 'Sun & Nat - fonctionne activement pour aider à changer le monde et chaque achat que vous effectuez sur notre site nous aide à faire de même. Nous nous sommes associés à quelques organismes de bienfaisance et aimerions que vos suggestions ajoutent les organismes de bienfaisance et les causes qui vous semblent ont besoin de notre aide et de ceux qui peuvent faire une différence pour les personnes.',
                'charityContain3suv': 'Sun & Nat fera don de 3% des produits de chaque vente à un organisme de bienfaisance que vous choisissez ou à un sur notre liste si vous n\'en choisissez pas un. Vous pouvez en outre aider à donner tout montant supplémentaire à la caisse.',
                'charityContain4suv': 'Si vous choisissez d\'ajouter 10 dollars, nous ajouterons plus de 10 dollars comme contribution à notre 3% initial (sous réserve d\'un maximum de 10% de la valeur de commande).',
                'charityContain5suv': 'Chaque cent est pris en compte et notre équipe travaille dur pour s\'assurer que l\'argent atteint les bonnes mains.',
                'charityContain6suv': 'Nous vous mettons à jour à chaque étape du processus afin que vous puissiez être satisfait lorsque vos contributions ont changé et amélioré des vies.',
                'returnProcessTitlesuv': 'Processus de retour',
                'aboutUsTitlesuv': 'SUV & NAT est une destination de mode de luxe en ligne avec 5 millions de visiteurs par mois et l\'expédition mondiale.',
                'aboutUsContainsuv': 'Le site Web présente la meilleure sélection des meilleurs designers établis ainsi que de jeunes talents émergents. Brandslabels a été fondée à Florence au début des années 1930, avec l\'ouverture du concept store éponyme de la société sur Via Roma. En ligne depuis 1999, la société attribue 90% du total des revenus aux ventes en ligne. À ce jour, il reste une entreprise familiale privée à 100%, avec le petit-fils du fondateur, Andrea Panonesi agissant en tant que PDG et sa fille, Annagreta Panconesi en tant que directrice créative.',
                'aboutUsContain1suv': 'Le site propose une large sélection de vêtements, de chaussures, de sacs, d\'accessoires, d\'intérieurs de maison de luxe et de beauté, avec des produits disponibles pour les hommes, les femmes et les enfants des designers les plus prestigieux tels que Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus et plus encore.',
                'aboutUsContain2suv': 'Il y a actuellement 200 personnes de 15 pays différents qui travaillent pour produire et maintenir des marques de marque. Le site est disponible en 9 langues: anglais, italien, allemand, chinois, russe, espagnol, français, coréen et japonais. Le site est créé entièrement en interne, avec la conception graphique de Florence Office, l\'informatique, le service client, le marketing et l\'achat. Les stylistes et les équipes de presse opèrent du bureau de Suvandnats dans la capitale de la mode du monde - Milan.',
                'aboutUsContain3suv': 'Toutes les commandes sont expédiées dans le monde entier du siège social de Suvandnats dans des boîtes préparées avec un maximum de soins et utilisent les meilleurs matériaux, des sacs de chaussures signature au ruban personnalisé.',
                'aboutUsContain4suv': 'Les Suvandnats comptaient 1,5 million de visiteurs uniques accéder au site en 2008 et sont passés à 53 millions de visiteurs uniques en 2017. Plus de 15% des ventes en ligne sont générées à partir des États-Unis, suivis par l\'Allemagne, le Royaume-Uni, l\'Italie, la Chine et la France.',
                'aboutUsContain5suv': 'Suvandnats repousse les limites du paysage de la vente au détail de luxe sur et hors ligne avec une gamme de services exclusifs et d\'initiatives de marque, notamment Buy It First, Luxury Club, Sneakers Club, LVR Privilege et LVR Editions.',
