                'charityContain1solo': 'Lorsque vous achetez chez nous, vous aidez à soutenir un rêve un rêve de donner à un avenir sécurisé un environnement heureux et une vie saine.',
                'charityContain2solo': 'L\'espoir est notre projet pour donner de l\'espoir et des opportunités à ceux qui en ont le plus besoin. Chaque dollar que vous dépensez sur notre site - aide à améliorer une vie quelque part, des réfugiés syriens à l\'éducation des enfants en Afrique ou à la fourniture d\'eau propre, nous souhaitons et espérons faire du monde un endroit plus égal.',
