                'returnPolicyContain12': '9. Les bijoux doivent être retournés dans le même état dans lequel il est arrivé, y compris tous les emballages et documents de marque fournis avec lui.',
                'aboutUsContain1solo': 'Solo est une destination de luxe en ligne avec 5 millions de visiteurs par mois et les expéditions mondiales.',
                'aboutUsContain2solo': 'Le site Web présente la meilleure sélection de designers établis thetop ainsi que de jeunes talents émergents. Solo a été fondé à Florence au début des années 1930, avec l\'ouverture du concept store éponyme de la société sur via Roma.online depuis 1999, la société attribue 90% des revenus totaux aux ventes en ligne. À ce jour, il reste une entreprise familiale privée à 100%, avec le petit-fils du fondateur, Andrea Panonesi agissant en tant que PDG et sa fille, Annagreta Panconesi en tant que directrice créative.',
                'aboutUsContain3solo': 'Le site propose une large sélection de vêtements, chaussures, sacs, accessoires, intérieurs de luxe et beauté, avec des produits disponibles pour les hommes, les femmes et les enfants des designers les plus prestigieux tels que Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus et plus encore.',
                'aboutUsContain4solo': 'Il y a actuellement 200 personnes de 15 pays différents qui travaillent pour produire et maintenir en solo. Le site est disponible en 9 langues: anglais, italien, allemand, chinois, russe, espagnol, français, coréen et japonais. Le site est créé entièrement en interne, avec la conception graphique de Florence Office, l\'informatique, le service client, le marketing et l\'achat. Les stylistes et les équipes de presse opèrent depuis le bureau solo dans la capitale de la mode du monde - Milan.',
                'aboutUsContain5solo': 'Toutes les commandes sont expédiées dans le monde entier du siège solo dans des boîtes préparées avec un maximum de soins et utilisent les meilleurs matériaux, des sacs de chaussures signature au ruban personnalisé.',
                'aboutUsContain6solo': 'Solo a eu 1,5 million de visiteurs uniques à accéder au site en 2008 et est passé à 53 millions de visiteurs uniques en 2017. Plus de 15% des ventes en ligne sont générées à partir des États-Unis, suivie de l\'Allemagne, du Royaume-Uni, de l\'Italie, de la Chine et de la France.',
                'aboutUsContain7solo': 'Solo repousse les limites du paysage de la vente au détail de luxe sur et hors ligne avec une gamme de services exclusifs et d\'initiatives de marque, notamment Buy It First, Luxury Club, Sneakers Club, LVR Privilege et LVR Editions.',
