                'appidveralusso': 'Veralusso',
                'charityTitleveralusso': 'Votre seul achat peut changer une vie.',
                'charityContain1veralusso': 'Veralusso - fonctionne activement pour aider à changer le monde et chaque achat que vous effectuez sur notre site - nous aide à faire de même. Nous nous sommes associés à quelques organismes de bienfaisance et aimerions que vos suggestions ajoutent les organismes de bienfaisance et les causes qui vous semblent ont besoin de notre aide et de ceux qui peuvent faire une différence pour les personnes.',
                'charityContain2veralusso': '11 millions d\'enfants de moins de 5 ans sont confrontés à une faim extrême ou à une famine à travers le monde.',
                'charityContain3veralusso': 'Les cas de personnes âgées abandonnées sont en augmentation dans le monde. La peur d\'être un fardeau doit se terminer.',
                'charityContain4veralusso': 'Statistiques annuelles. Environ 7,6 millions d\'animaux entrent dans un refuge pour animaux à l\'échelle nationale. Environ 2,7 millions de refuges sont euthanasiés. Environ 2,7 millions d\'animaux d\'abri sont adoptés.',
                'charityContain5veralusso': 'Veralusso fera don de 3% des produits de chaque vente à un organisme de bienfaisance que vous choisissez ou à un sur notre liste si vous n\'en choisissez pas un. Vous pouvez en outre aider à faire don de tout montant supplémentaire à la caisse. Si vous choisissez d\'ajouter 10 dollars, nous ajouterons 10 dollars supplémentaires comme notre contribution supplémentaire à nos 3% initiaux (sous réserve d\'un maximum de 10% de la valeur de commande).',
                'charityContain6veralusso': 'Chaque centime est comptabilisé et notre équipe travaille dur pour s\'assurer que l\'argent atteint les bonnes mains.',
