                'charityContain2': 'Bij gele bladhangmatten geloven we dat het creëren van ethische banen een empowerment is voor langdurige oplossing voor extreme armoede.',
                'charityContain3': 'In plaats van een lappendeken van liefdadigheidsdonaties te organiseren om water, voeding, kleding, enz. Te bieden, werken we rechtstreeks samen met gezinnen om een ​​uitgebreide, waardige, langetermijnstrategie op te bouwen naar een betere toekomst. De oorzaken achter systemische armoede zijn ingewikkeld, maar de financiële stabiliteit op lange termijn is binnen handbereik.',
                'charityContain4': 'Simpel gezegd: door ons te concentreren op middelen van bestaan, kunnen we de middelste man uitsnijden, geld rechtstreeks in handen krijgen van slimme + vindingrijke moeders en gezinnen in staat stellen hun eigen problemen aan te pakken (zonder onderworpen te zijn aan de agenda van iemand anders).',
                'charityContain5': 'In drie wevende gemeenschappen werken we om banen voor moeders te creëren en een basis te leggen voor positieve gemeenschapstransformatie. Door flexibel, veilig \"welvaartsloon\" weven werk, kunnen onze ambachtslieden hun families ophalen van armoede en schuldenslavernij naar de middenklasse.',
                'charityContain6': '** Het creëren van banen voor vrouwen is vooral belangrijk voor gemeenschapstransformatie - onderzoek toont aan dat vrouwen tot 90% van hun inkomsten zullen uitgeven aan de gezondheid, voeding en onderwijs van hun families. Het veranderen van vrouwen in kostwinners verbetert hun status in de gemeenschap, bouwt zelfrespect op en stelt hen in staat middelen te bundelen om de infrastructuur te verbeteren.',
