                'appNameTextsuv': 'SUV & NAT',
                'charityTitlesuv': 'Winkel meer bewust',
                'charityContain1suv': 'Elke aankoop die u doet, helpt de toekomst van een kind uit te pesten.',
                'charityContain2suv': 'Sun & Nat - Werkt actief om de wereld te helpen veranderen en elke aankoop die u op onze site doet, helpt ons hetzelfde te doen. We hebben samengewerkt met een paar goede doelen en willen graag dat uw suggesties de goede doelen en oorzaken toevoegen die volgens u onze hulp nodig hebben en die welke een verschil kunnen maken voor mensenlevens.',
                'charityContain3suv': 'Sun & Nat doneren 3% van de opbrengst van elke verkoop aan een goed doel dat u kiest of aan één op onze lijst als u er geen kiest. U kunt verder helpen bij het doneren van elk extra bedrag bij de kassa.',
                'charityContain4suv': 'Als u ervoor kiest om 10 dollar toe te voegen, zullen we verder 10 dollar toevoegen als onze bijdrage aan onze initiële 3% (onderworpen aan een maximum van 10% van de bestelwaarde).',
                'charityContain5suv': 'Elke cent wordt verantwoord en ons team werkt hard om ervoor te zorgen dat het geld in de juiste handen reikt.',
                'charityContain6suv': 'We updaten u elke stap van de weg, zodat u tevreden kunt zijn wanneer uw bijdragen levens hebben veranderd en verbeterd.',
                'returnProcessTitlesuv': 'Retourproces',
                'aboutUsTitlesuv': 'SUV & NAT is een top online luxe modebestemming met 5 miljoen bezoekers per maand en wereldwijde verzending.',
                'aboutUsContainsuv': 'De website biedt de beste selectie van de best gevestigde ontwerpers en jonge opkomende talenten. Brandslabels werd in de vroege jaren 1930 opgericht in Florence, met de opening van de gelijknamige conceptwinkel van het bedrijf via Roma. Online sinds 1999 schrijft het bedrijf 90% van de totale omzet toe aan online omzet. Tot op de dag van vandaag blijft het een 100% particulier familiebedrijf, met de kleinzoon van de oprichter, Andrea Panconesi als CEO en zijn dochter, Annagreta Panconesi als creatief directeur.',
                'aboutUsContain1suv': 'De site biedt een brede selectie kleding, schoenen, tassen, accessoires, luxe thuisinterieurs en schoonheid, met producten die beschikbaar zijn voor mannen, vrouwen en kinderen van de meest prestigieuze ontwerpers zoals Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus en meer.',
                'aboutUsContain2suv': 'Er zijn momenteel 200 mensen uit 15 verschillende landen die werken aan het produceren en onderhouden van BrandSlabels. De site is beschikbaar in 9 talen: Engels, Italiaans, Duits, Chinees, Russisch, Spaans, Frans, Koreaans en Japans. De site is volledig in eigen huis gemaakt, met het grafisch ontwerp van Florence Office, IT, klantenservice, marketing- en koopafdelingen. De stylisten en persteams werken vanuit het Suvandnats -kantoor in de modehoofdstad van de wereld - Milaan.',
                'aboutUsContain3suv': 'Alle bestellingen worden wereldwijd verzonden vanuit het hoofdkantoor van het Suvandnats in dozen die zijn bereid met maximale zorg en de beste materialen gebruiken, van de kenmerkende schoenzakken tot het gepersonaliseerde lint.',
                'aboutUsContain4suv': 'Suvandnats had in 2008 1,5 miljoen unieke bezoekers toegang tot de site en is in 2017 gegroeid tot 53 miljoen unieke bezoekers. Meer dan 15% van de online verkopen wordt gegenereerd uit de Verenigde Staten, gevolgd door Duitsland, VK, Italië, China en Frankrijk.',
                'aboutUsContain5suv': 'Suvandnats verlegt de grenzen van het luxe retaillandschap zowel aan als offline met een scala aan exclusieve diensten en handelsmerkinitiatieven, waaronder Buy It First, Luxury Club, Sneakers Club, LVR Privilege en LVR -edities.',
