                'returnPolicyTitlesolo': 'RETOURBELEID',
                'returnPolicyContain2solo': '1. Items must be returned unworn, undamaged and unused, with all tags attached and the original packaging included.',
                'returnPolicyContain3solo': '2. Footwear and accessories must be returned with the original branded boxes and dust bags, where provided, and placed inside a protective outer box for shipping.',
                'returnPolicyContain4solo': '3. When trying on footwear, please take care not to mark the soles or damage the shoe box.',
                'returnPolicyContain5solo': '4. If an item has a Avoirchic security tag or brand tag attached, it must be returned with the tag in its original.',
                'returnPolicyContain6solo': '5. Beauty and cosmetic products must be returned unopened and unused, with the seals of any packaging still intact.',
                'returnPolicyContain7solo': '6. Hosiery, lingerie and swimwear items must be returned with the hygiene seals attached and in unopened and undamaged product packaging, where applicable.',
                'returnPolicyContain8solo': '7. Lingerie and swimwear must only be tried on over your own undergarments. We will not accept any returns that have been worn or are soiled.',
                'returnPolicyContain9solo': '8. Face masks must be returned unworn in their original, unopened and undamaged product packaging.',
                'returnPolicyContain12': '9. Sieraden moeten in dezelfde staat worden geretourneerd waarin deze is aangekomen, inclusief alle verbonden merkverpakkingen en documenten die ermee worden verstrekt.',
                'aboutUsContain1solo': 'Solo is een top online luxe fashion -bestemming met 5 miljoen bezoekers per maand en wereldwijde verzending.',
                'aboutUsContain2solo': 'De website bevat de beste selectie van thetop gevestigde ontwerpers als Wellas Young Emerging Talents. Solo werd in de vroege jaren 1930 opgericht in Florence, met de opening van de gelijknamige conceptwinkel van het bedrijf via Roma.Online sinds 1999, het bedrijf schrijft 90% van de totale omzet toe aan online verkoop. Tot op de dag van vandaag blijft het een 100% particulier familiebedrijf, met de kleinzoon van de oprichter, Andrea Panconesi als CEO en zijn dochter, Annagreta Panconesi als creatief directeur.',
                'aboutUsContain3solo': 'De site biedt een brede selectie van kleding, schoenen, tassen, accessoires, luxe interieurs en schoonheid, met producten die beschikbaar zijn voor mannen, vrouwen en kinderen van de meest prestigieuze ontwerpers zoals Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus en meer.',
                'aboutUsContain4solo': 'Er zijn momenteel 200 mensen uit 15 verschillende landen die werken om solo te produceren en te behouden. De site is beschikbaar in 9 talen: Engels, Italiaans, Duits, Chinees, Russisch, Spaans, Frans, Koreaans en Japans. De site is volledig in eigen huis gemaakt, met het grafisch ontwerp van Florence Office, IT, klantenservice, marketing- en koopafdelingen. De stylisten en persteams werken vanuit het solo -kantoor in de modehoofdstad van de wereld - Milan.',
                'aboutUsContain5solo': 'Alle bestellingen worden wereldwijd verzonden vanuit het solo -hoofdkantoor in dozen die met maximale zorg worden bereid en de beste materialen gebruiken, van de kenmerkende schoenzakken tot het gepersonaliseerde lint.',
                'aboutUsContain6solo': 'Solo had 1,5 miljoen unieke bezoekers toegang tot de site in 2008 en is gegroeid tot 53 miljoen unieke bezoekers in 2017. Meer dan 15% van de online verkoop wordt gegenereerd uit de Verenigde Staten, gevolgd door Duitsland, VK, Italië, China en Frankrijk.',
                'aboutUsContain7solo': 'Solo verlegt de grenzen van het luxe retaillandschap zowel aan als offline met een scala aan exclusieve diensten en handelsmerkinitiatieven, waaronder Buy It First, Luxury Club, Sneakers Club, LVR Privilege en LVR -edities.',
