                'charityTitleveralusso': 'Uw ene aankoop kan een leven veranderen.',
                'charityContain1veralusso': 'Veralusso - Werkt actief om de wereld te helpen veranderen en elke aankoop die u op onze site doet - helpt ons hetzelfde te doen. We hebben samengewerkt met een paar goede doelen en willen graag dat uw suggesties de goede doelen en oorzaken toevoegen die volgens u onze hulp nodig hebben en die welke een verschil kunnen maken voor mensenlevens.',
