                'charityContain4': '简而言之：通过关注生计，我们可以削减中间人，将钱直接掌握在聪明的 +机智的母亲的手中，并赋予家庭权力解决自己的问题（而不受其他任何人的议程的约束）。',
                'charityContain5': '在三个编织社区中，我们正在努力为母亲创造就业机会，并为积极的社区转型奠定基础。通过灵活，安全的“繁荣工资”编织工作，我们的工匠能够将他们的家人从贫困和债务奴隶制升至中产阶级。',
                'charityContain6': '**为妇女创造就业机会对于社区转型尤为重要 - 研究表明，妇女将在家庭的健康，营养和教育上花费多达90％的收入。将妇女变成养家糊口的人改善了她们在社区中的地位，建立自尊心，并使她们能够集中资源以改善基础设施。',
