                'aboutUsContain1': 'Brands＆Labels是顶级在线豪华时尚目的地，每月有500万游客和全球运输。',
                'aboutUsContain2': '该网站具有最佳成熟设计师以及年轻新兴才能的最佳选择。 Brandslabels于1930年代初在佛罗伦萨成立，该公司的同名概念商店在Via Roma上开业。自1999年以来，该公司将总收入的90％归因于在线销售。直到今天，它仍然是100％的私人家族企业，创始人的孙子安德里亚·潘科尼（Andrea Panconesi）担任首席执行官和他的女儿安纳格雷塔·潘科尼西（Annagreta Panconesi）担任创意总监。',
                'aboutUsContain3': '该网站提供各种服装，鞋子，袋子，配件，豪华家庭室内装饰和美容，并提供来自Balenciaga，Balenciaga，Vetements，vetements，off-White，off-White，J.W.等最负盛名的设计师的男士，女人和孩子的产品。 Anderson，Balmain，Dolce＆Gabbana，Gucci，Saint Laurent，Valentino，Givenchy，Loewe，Jacquemus等。',
                'aboutUsContain4': '目前，来自15个不同国家的200人致力于生产和维护品牌标签。该网站有9种语言：英语，意大利语，德语，中文，俄语，西班牙语，法语，韩语和日语。该网站是完全内部创建的，佛罗伦萨办公室住房图形设计，IT，客户服务，营销和购买部门。造型师和新闻团队在世界时尚之都米兰的BrandSlabels办公室运营。',
                'aboutUsContain5': '所有订单均通过品牌标签总部的全球发货，这些盒子由最大程度的护理准备，并使用最好的材料，从签名鞋袋到个性化的丝带。',
                'aboutUsContain6': 'Brandslabels拥有150万唯一的访问者在2008年访问该网站，并在2017年已增长到5300万唯一的访客。超过15％的在线销售是从美国产生的，其次是德国，英国，意大利，中国和法国。',
                'aboutUsContain7': 'BrandSlabels通过一系列独家服务和商标计划在包括First It It，豪华俱乐部，运动鞋俱乐部，LVR Privilege和LVR版本在内的一系列独家服务和商标倡议，推动了豪华零售景观的界限。',
