                'thereAreStillMoreThanMSG': '每天不到1.25美元，全世界仍然有超过十亿人在世界各地生活。仅在泰国，社会边缘就存在超过一百万的希尔部落成员 - 被拒绝公民身份，被拒之门外的就业市场，容易受到剥削和贩运。',
