                'acrossThreeWeavingCommunitiesMsg': '在三个编织社区中，我们正在努力为母亲创造就业机会，并为积极的社区转型奠定基础。通过灵活，安全的“繁荣工资”编织工作，我们的工匠能够将他们的家人从贫困和债务奴隶制升至中产阶级。',
                'creatingJobsForWomenMsg': '**为妇女创造就业机会对于社区转型尤为重要 - 研究表明，妇女将在家庭的健康，营养和教育上花费多达90％的收入。将妇女变成养家糊口的人改善了她们在社区中的地位，建立自尊心，并使她们能够集中资源以改善基础设施。',
                'theFoundationForABrighterFuter': '更亮的料理的基础',
                'theSecurityOfAStableMsg': '稳定，增长的收入来源的安全对村庄产生了巨大影响。 Mlabri能够成立一所学校，并建立一个社区中心进行编织和社交。他们建立了泰国最早的失业资金之一。随着经济能力的增加，他们成功游说了公民身份和公民权利，这是2001年最初授予的。吊床编织是灵活的工作，非常适合可以在家工作并制定自己的日程安排的母亲。不幸的是，如果没有进入全球市场的机会，对吊床的需求仅限于泰国旅游季节，并且无法确保全年就业。',
