                'aboutUsBrandsSecond': 'يتميز الموقع بأفضل مجموعة من أفضل المصممين المعمول بها بالإضافة إلى المواهب الناشئة الشباب. تأسست Brands & Labels في فلورنسا في أوائل ثلاثينيات القرن العشرين ، مع افتتاح متجر مفهوم الشركة الذي يسيء إلى Via Roma. على الإنترنت منذ عام 1999 ، تعزو الشركة 90 ٪ من إجمالي الإيرادات للمبيعات عبر الإنترنت. حتى يومنا هذا ، تظل شركة عائلية مملوكة ملكية خاصة بنسبة 100 ٪ ، حيث يعمل حفيد المؤسس ، أندريا باندريا كرئيس تنفيذي وابنته ، أنغريتا بانسانسي كمدير إبداعي.',
