                'charityContain1': 'لا يزال هناك أكثر من مليار شخص حول العالم يعيشون في فقر مدقع بأقل من \ 1.25 دولار في اليوم. في تايلاند وحدها ، يوجد أكثر من مليون فرد من قبائل التلال على هامش المجتمع - محرومون من الجنسية ، ومستبعدون من سوق العمل الرسمي وعرضة للاستغلال والاتجار.',
                'charityContain2': 'في أرجوحة الأوراق الصفراء ، نعتقد أن خلق فرص العمل الأخلاقي هو حل طويل الأجل للفقر الشديد.',
                'charityContain3': 'بدلاً من تنظيم مجموعة من التبرعات الخيرية لتوفير المياه والتغذية والملابس ، وما إلى ذلك ، نعمل مباشرة مع العائلات لبناء استراتيجية شاملة وكريمة وطويلة الأجل نحو مستقبل أكثر إشراقًا. الأسباب وراء الفقر الجهازي معقدة ، ولكن الاستقرار المالي طويل الأجل في متناول اليد.',
                'charityContain4': 'بعبارة ببساطة: من خلال التركيز على سبل العيش ، يمكننا قطع الرجل الأوسط ، والحصول على المال مباشرة في أيدي الأمهات الذكية + الحيلة وتمكين العائلات من معالجة مشاكلهن الخاصة (دون أن نخضع لجدول أعمال أي شخص آخر).',
                'charityContain5': 'عبر ثلاث مجتمعات نسج ، نعمل على خلق فرص عمل للأمهات وبناء أساس لتحول المجتمع الإيجابي. من خلال أعمال النسيج المرنة والآمنة \"للأجور\" ، يمكن للحرفيين لدينا رفع أسرهم من الفقر وعبودية الديون إلى الطبقة الوسطى.',
