                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'يجب إرجاع العناصر غير المصلحة وغير التالفة وغير المستخدمة ، مع إرفاق جميع العلامات وإدراج العبوة الأصلية.',
