                'aboutUsText': 'معلومات عنا',
                'aboutUsTitle': 'نحن العلامة التجارية والعلامات',
                'aboutUsContain': 'استكشف 100 من أفضل العلامات التجارية في العالم',
                'aboutUsContain1': 'تعد Brands & Labels وجهة أزياء فاخرة على الإنترنت مع 5 ملايين زائر شهريًا والشحن في جميع أنحاء العالم.',
                'aboutUsContain2': 'يتميز الموقع بأفضل مجموعة من أفضل المصممين المعمول بها بالإضافة إلى المواهب الناشئة الشباب. تأسست Brandslabels في فلورنسا في أوائل ثلاثينيات القرن العشرين ، مع افتتاح متجر المفهوم الذي يطلق عليه الشركة في Via Roma. على الإنترنت منذ عام 1999 ، تعزو الشركة 90 ٪ من إجمالي الإيرادات للمبيعات عبر الإنترنت. حتى يومنا هذا ، تظل شركة عائلية مملوكة ملكية خاصة بنسبة 100 ٪ ، حيث يعمل حفيد المؤسس ، أندريا باندريا كرئيس تنفيذي وابنته ، أنغريتا بانسانسي كمدير إبداعي.',
                'aboutUsContain3': 'يوفر الموقع مجموعة واسعة من الملابس والأحذية والحقائب والإكسسوارات والتصميمات الداخلية المنزلية الفاخرة والجمال ، مع منتجات متوفرة للرجال والنساء والأطفال من المصممين الأكثر شهرة مثل Balenciaga و Vetements و Off-Off-White و J.W. Anderson ، Balmain ، Dolce & Gabbana ، Gucci ، Saint Laurent ، Valentino ، Givenchy ، Loewe ، Jacquemus والمزيد.',
                'aboutUsContain4': 'يوجد حاليًا 200 شخص من 15 دولة مختلفة تعمل على إنتاج وصيانة Brandslabels. الموقع متاح في 9 لغات: الإنجليزية والإيطالية والألمانية والصينية والروسية والإسبانية والفرنسية والكورية واليابانية. تم إنشاء الموقع في المنزل بالكامل ، مع تصميمات الرسومات الإسكان في مكتب فلورنسا ، وتكنولوجيا المعلومات ، وخدمة العملاء ، والتسويق وشراء أقسام. تعمل المصممون وفرق الصحافة من مكتب Brandslabels في عاصمة الأزياء في العالم - ميلانو.',
                'aboutUsContain5': 'يتم شحن جميع الطلبات في جميع أنحاء العالم من مقر Brands Labels في الصناديق التي يتم إعدادها بأقصى قدر من الرعاية واستخدام أفضل المواد ، من أكياس الأحذية المميزة إلى الشريط المخصص.',
                'aboutUsContain6': 'كان لدى Brandslabels 1.5 مليون زائر فريد من خلال الوصول إلى الموقع في عام 2008 ونما إلى 53 مليون زائر فريد من نوعه في عام 2017. يتم إنشاء أكثر من 15 ٪ من المبيعات عبر الإنترنت من الولايات المتحدة ، تليها ألمانيا والمملكة المتحدة وإيطاليا والصين وفرنسا.',
                'aboutUsContain7': 'يدفع Brandslabels حدود المشهد الفاخرة للبيع بالتجزئة على حد سواء على كل من مجموعة من الخدمات الحصرية ومبادرات العلامات التجارية بما في ذلك Buy It First و Luxury Club و Sneakers Club و LVR امتياز وإصدارات LVR.',
