                'thereAreStillMoreThanMSG': 'لا يزال هناك أكثر من مليار شخص حول العالم الذين يعيشون في فقر شديد على أقل من 1.25 دولار في اليوم. في تايلاند وحدها ، نفى أكثر من مليون عضو من قبائل التل على هوامش المجتمع - المواطنة ، وإغلاقها من سوق العمل الرسمي ووضعهم في الاستغلال والاتجار.',
