                'insteadOfOrganizingMsg': 'بدلاً من تنظيم مجموعة من التبرعات الخيرية لتوفير المياه والتغذية والملابس ، وما إلى ذلك ، نعمل مباشرة مع العائلات لبناء استراتيجية شاملة وكريمة وطويلة الأجل نحو مستقبل أكثر إشراقًا. الأسباب وراء الفقر الجهازي معقدة ، ولكن الاستقرار المالي طويل الأجل في متناول اليد.',
                'toPutItSimplyMsg': 'بعبارة ببساطة: من خلال التركيز على سبل العيش ، يمكننا قطع الرجل الأوسط ، والحصول على المال مباشرة في أيدي الأمهات الذكية + الحيلة وتمكين العائلات من معالجة مشاكلهن الخاصة (دون أن نخضع لجدول أعمال أي شخص آخر).',
                'acrossThreeWeavingCommunitiesMsg': 'عبر ثلاث مجتمعات نسج ، نعمل على خلق فرص عمل للأمهات وبناء أساس لتحول المجتمع الإيجابي. من خلال أعمال النسيج المرنة والآمنة \"للأجور\" ، يمكن للحرفيين لدينا رفع أسرهم من الفقر وعبودية الديون إلى الطبقة الوسطى.',
                'creatingJobsForWomenMsg': '** إن خلق فرص عمل للنساء أمر مهم بشكل خاص لتحول المجتمع - يظهر الأبحاث أن النساء سوف ينفقن ما يصل إلى 90 ٪ من أرباحهن على الصحة والتغذية وتعليم أسرهن. يحول تحويل النساء إلى عيلنز إلى تحسين وضعهن في المجتمع ، ويبني احترامهم للذات ويمكّنهن من تجميع الموارد لتحسين البنية التحتية.',
                'theFoundationForABrighterFuter': 'الأساس لمستودع أكثر إشراقًا',
                'theSecurityOfAStableMsg': 'كان لأمن مصدر الإيرادات المستقر والمتزايد تأثير هائل على القرية. تمكن Mlabri من بدء مدرسة وبناء مركز مجتمعي للنسج والتواصل الاجتماعي. أنشأوا واحدة من صناديق البطالة الأولى في تايلاند. مع زيادة القوة الاقتصادية ، نجحوا في الضغط على الجنسية والحقوق المدنية ، والتي مُنحت لأول مرة في عام 2001. إن نسج الأرجوحة هو عمل مرن ، وهو مثالي للأمهات اللائي يمكنهم العمل من المنزل ووضع جداولهم الخاصة. لسوء الحظ ، دون الوصول إلى الأسواق العالمية ، اقتصر الطلب على الأراجيح على موسم السياحة التايلاندي ولم تكن هناك طريقة لضمان عمل على مدار السنة.',
                'spreadingLastingChangeTheHammockRrevolution': 'تغيير دائم: نهر أرجوحة الثورة',
                'thisIsAboutWhereMsg': 'هذا هو المكان الذي تنضم فيه Leafe Leaf إلى القصة! على مدار السنوات القليلة الماضية ، عملنا على تطوير قنوات مبيعات متسقة ، وبناء شراكات دولية وتثبيت عمليات الاستقرار داخل القرى.',
                'corollaryEconomicMsg': 'نشأت الفرص الاقتصادية الطبيعية ، مثل مكتب البريد ، وإعداد الطعام ، وزراعة القهوة المستدامة لتوظيف أولئك الذين لا ينسجون. حفزت شراكتنا مع KIVA التدريب المالي والتخطيط المالي ، حيث افتتح العديد من النساجين حسابات مصرفية لأول مرة في حياتهم!',
                'wWithOurGrowthMsg': 'مع استمرار نمونا في التسارع ، لن نتمكن فقط من توظيف جميع نساج Mlabri على مدار السنة ، سنكون قادرين أيضًا على مواصلة التوسع وتوفير التدريب والعمالة المستمرة لمجتمعات قبيلة هيل في المنطقة المحيطة. إلى أن تتوفر أعمال النسيج والوظائف المستدامة في جميع أنحاء المنطقة ، ستستمر الممارسات الزراعية المدمرة ولن تنتهي الدورة الاستغلالية للعبودية المحتوية.',
                'throughTheEstablishmentMsg': 'من خلال إنشاء Leaf Leaf كعلامة تجارية عالمية لأسلوب الحياة ، ستتمكن قرى Hill Tribe التي نتشارك معها من الحفاظ على هذا التأثير الإيجابي ومواصلة وضع الأساس لمستقبل أكثر إشراقًا.',
