                'appNameTextsuv': 'سيارات الدفع الرباعي و NAT',
                'charityTitlesuv': 'تسوق أكثر وعيا',
                'charityContain1suv': 'كل عملية شراء تقوم بها ستساعد على Buld a Childs Future.',
                'charityContain2suv': 'Sun & Nat - يعمل بنشاط للمساعدة في تغيير العالم وكل عملية شراء تقوم بها على موقعنا تساعدنا على فعل الشيء نفسه. لقد شاركنا في شراكة مع عدد قليل من الجمعيات الخيرية ونود أن تضيف اقتراحاتك الجمعيات الخيرية والأسباب التي تشعر أنها بحاجة إلى مساعدتنا وتلك التي يمكن أن تحدث فرقًا في حياة الناس.',
                'charityContain3suv': 'ستتبرع Sun & Nat بنسبة 3 ٪ من عائدات كل عملية بيع إلى مؤسسة خيرية تختارها أو إلى واحدة في قائمتنا إذا لم تختار واحدة. يمكنك مزيد من المساعدة في التبرع بأي مبلغ إضافي عند الخروج.',
                'charityContain4suv': 'إذا اخترت إضافة 10 دولارات ، فسنضيف 10 دولارات أخرى كمساهمتنا الإضافية إلى 3 ٪ الأولية (مع مراعاة 10 ٪ كحد أقصى من قيمة الطلب).',
                'charityContain5suv': 'يتم حساب كل سنت ويعمل فريقنا بجد لضمان وصول الأموال في الأيدي اليمنى.',
                'charityContain6suv': 'نقوم بتحديثك في كل خطوة على الطريق حتى تتمكن من الرضا عندما تتغير مساهماتك وتحسين الأرواح.',
                'returnProcessTitlesuv': 'عملية العودة',
                'aboutUsTitlesuv': 'SUV & NAT هي وجهة أزياء فاخرة على الإنترنت مع 5 ملايين زائر شهريًا وشحن عالمي.',
                'aboutUsContainsuv': 'يتميز الموقع بأفضل مجموعة من أفضل المصممين المعمول بها بالإضافة إلى المواهب الناشئة الشباب. تأسست Brandslabels في فلورنسا في أوائل ثلاثينيات القرن العشرين ، مع افتتاح متجر المفهوم الذي يطلق عليه الشركة في Via Roma. على الإنترنت منذ عام 1999 ، تعزو الشركة 90 ٪ من إجمالي الإيرادات للمبيعات عبر الإنترنت. حتى يومنا هذا ، تظل شركة عائلية مملوكة ملكية خاصة بنسبة 100 ٪ ، حيث يعمل حفيد المؤسس ، أندريا باندريا كرئيس تنفيذي وابنته ، أنغريتا بانسانسي كمدير إبداعي.',
                'aboutUsContain1suv': 'يوفر الموقع مجموعة واسعة من الملابس والأحذية والحقائب والإكسسوارات والتصميمات الداخلية المنزلية الفاخرة والجمال ، مع منتجات متوفرة للرجال والنساء والأطفال من المصممين الأكثر شهرة مثل Balenciaga و Vetements و Off-Off-White و J.W. Anderson ، Balmain ، Dolce & Gabbana ، Gucci ، Saint Laurent ، Valentino ، Givenchy ، Loewe ، Jacquemus والمزيد.',
                'aboutUsContain2suv': 'يوجد حاليًا 200 شخص من 15 دولة مختلفة تعمل على إنتاج وصيانة Brandslabels. الموقع متاح في 9 لغات: الإنجليزية والإيطالية والألمانية والصينية والروسية والإسبانية والفرنسية والكورية واليابانية. تم إنشاء الموقع في المنزل بالكامل ، مع تصميمات الرسومات الإسكان في مكتب فلورنسا ، وتكنولوجيا المعلومات ، وخدمة العملاء ، والتسويق وشراء أقسام. تعمل المصممون وفرق الصحافة من مكتب Suvandnats في عاصمة الأزياء في العالم - ميلانو.',
                'aboutUsContain3suv': 'يتم شحن جميع الطلبات في جميع أنحاء العالم من مقر Suvandnats في الصناديق التي يتم إعدادها بأقصى قدر من الرعاية واستخدام أفضل المواد ، من أكياس الأحذية المميزة إلى الشريط المخصص.',
                'aboutUsContain4suv': 'كان لدى Suvandnats 1.5 مليون زائر فريد وصوله إلى الموقع في عام 2008 ونما إلى 53 مليون زائر فريد من نوعه في عام 2017. يتم إنشاء أكثر من 15 ٪ من المبيعات عبر الإنترنت من الولايات المتحدة ، تليها ألمانيا والمملكة المتحدة وإيطاليا والصين وفرنسا.',
                'aboutUsContain5suv': 'تدفع Suvandnats حدود المشهد الفاخرة للبيع بالتجزئة على حد سواء على كل من مجموعة من الخدمات الحصرية ومبادرات العلامات التجارية بما في ذلك Buy It First و Luxury Club و Sneakers Club و LVR امتياز وإصدارات LVR.',
