                'appidveralusso': 'Veralusso',
                'charityTitleveralusso': 'يمكن أن يغير عملية الشراء الواحدة الحياة.',
                'charityContain1veralusso': 'Veralusso - يعمل بنشاط للمساعدة في تغيير العالم وكل عملية شراء تقوم بها على موقعنا - يساعدنا على فعل الشيء نفسه. لقد شاركنا في شراكة مع عدد قليل من الجمعيات الخيرية ونود أن تضيف اقتراحاتك الجمعيات الخيرية والأسباب التي تشعر أنها بحاجة إلى مساعدتنا وتلك التي يمكن أن تحدث فرقًا في حياة الناس.',
                'charityContain2veralusso': 'يقدر 11 مليون طفل تحت 5 سنوات يواجهون الجوع الشديد أو الجوع في جميع أنحاء العالم.',
                'charityContain3veralusso': 'حالات كبار السن المهجرين في جميع أنحاء العالم. يحتاج الخوف من أن تكون عبئًا إلى إنهاء.',
                'charityContain4veralusso': 'الإحصاءات السنوية. ما يقرب من 7.6 مليون حيوان يدخلون المأوى للحيوانات على مستوى البلاد. ما يقرب من 2.7 مليون شيلترانيمسال يتم التخلص منها. يتم تبني حوالي 2.7 مليون حيوان من المأوى.',
                'charityContain5veralusso': 'ستتبرع Veralusso بنسبة 3 ٪ من عائدات كل عملية بيع إلى مؤسسة خيرية تختارها أو إلى واحدة في قائمتنا إذا لم تختار واحدة. يمكنك مزيد من المساعدة في التبرع بأي مبلغ إضافي عند الخروج. إذا اخترت إضافة 10 دولارات ، فسوف نضيف 10 دولارات أخرى كمساهمات إضافية إضافية إلى 3 ٪ الأولية (مع مراعاة 10 ٪ كحد أقصى من قيمة الطلب).',
                'charityContain6veralusso': 'يتم حساب كل سنت ويعمل فريقنا بجد لضمان وصول الأموال إلى الأيدي اليمنى.',
                'charityContain7': 'نقوم بتحديثك في كل خطوة على الطريق حتى تتمكن من الرضا عندما تتغير مساهماتك وتحسين الأرواح.',
                'stLine1': 'العنوان (الخط 1',
                'stLine2': 'عنوان الشارع: السطر 2',
                'stLine3': 'عنوان الشارع: السطر 3',
                'indiaTextveralusso': 'الهند',
                'stateTextveralusso': 'الرجاء اختيار منطقة أو ولاية أو مقاطعة',
                'appNameTextveralusso': 'فيرا لوسو',
                'customisedTitleveralusso': 'العناصر المخصصة والمملوكة قبل المملوكة',
                'aboutUsContainveralusso': 'Vera Lusso هي وجهة أزياء فاخرة على الإنترنت مع 5 ملايين زائر شهريًا والشحن في جميع أنحاء العالم.',
                'aboutUsContain1veralusso': 'يتميز الموقع بأفضل مجموعة مختارة من المصممين المؤسسين والمواهب الناشئة الشباب. تأسست Vera Lusso في فلورنسا في أوائل الثلاثينيات ، مع افتتاح متجر المفهوم الذي يطلق عليه الشركة في Via Roma. على الإنترنت منذ عام 1999 ، تعزو الشركة 90 ٪ من إجمالي الإيرادات للمبيعات عبر الإنترنت. حتى يومنا هذا ، تظل شركة عائلية مملوكة ملكية خاصة بنسبة 100 ٪ ، حيث يعمل حفيد المؤسس ، أندريا باندريا كرئيس تنفيذي وابنته ، أنغريتا بانسانسي كمدير إبداعي.',
                'aboutUsContain2veralusso': 'يوفر الموقع مجموعة واسعة من الملابس والأحذية والحقائب والإكسسوارات والتصميمات الداخلية المنزلية الفاخرة والجمال ، مع منتجات متوفرة للرجال والنساء والأطفال من المصممين الأكثر شهرة مثل Balenciaga ، Vetements ، Off-White ، J.W. Anderson ، Balmain ، Dolce & Gabbana ، Gucci ، Saint Laurent ، Valentino ، Givenchy ، Loewe Jacquemus والمزيد.',
                'aboutUsContain3veralusso': 'يوجد حاليًا 200 شخص من 15 دولة مختلفة تعمل على إنتاج وصيانة Vera Lusso. الموقع متاح في 9 لغات: اللغة الإنجليزية الإيطالية والألمانية والصينية والروسية والإسبانية الفرنسية والكورية واليابانية. تم إنشاء الموقع في المنزل بالكامل ، مع تصميمات الرسومات الإسكان في مكتب فلورنسا ، وتكنولوجيا المعلومات ، وخدمة العملاء ، والتسويق وشراء أقسام. تعمل المصممون وفرق الصحافة من مكتب Vera Lusso في عاصمة الأزياء في العالم - ميلانو.',
                'aboutUsContain4veralusso': 'يتم شحن جميع الطلبات في جميع أنحاء العالم من مقر Vera Lusso في الصناديق التي يتم إعدادها بأقصى قدر من الرعاية واستخدام أفضل المواد ، من أكياس الأحذية المميزة إلى الشريط المخصص.',
                'aboutUsContain5veralusso': 'كان لدى Vera Lusso 1.5 مليون زائر فريد وصوله إلى الموقع في عام 2008 ونما إلى 53 مليون زائر فريد في عام 2017. يتم إنشاء أكثر من 15 ٪ من المبيعات عبر الإنترنت من الولايات المتحدة ، تليها ألمانيا والمملكة المتحدة وإيطاليا والصين وفرنسا.',
                'aboutUsContain6veralusso': 'تدفع Vera Lusso حدود المشهد الفاخرة للبيع بالتجزئة على حد سواء في وضع غير متصل بالإنترنت مع مجموعة من الخدمات الحصرية ومبادرات العلامات التجارية بما في ذلك Buy It First و Luxury Club و Sneakers Club و LVR امتياز وإصدارات LVR.',
