                'aboutUsContain2solo': 'ویب سائٹ میں تھیٹوپ قائم ڈیزائنرز کے ساتھ ساتھ ویلاس ینگ ابھرتی ہوئی صلاحیتوں کا بہترین انتخاب پیش کیا گیا ہے۔ 1930 کی دہائی کے اوائل میں فلورنس میں سولو کی بنیاد رکھی گئی تھی ، 1999 کے بعد سے روما ڈاٹ آن لائن پر کمپنی کے معروف تصوراتی اسٹور کے افتتاح کے ساتھ ، کمپنی کل آمدنی کا 90 ٪ آن لائن فروخت سے منسوب ہے۔ آج تک یہ بانی کے پوتے ، آندریا پانکونسی کے ساتھ سی ای او اور ان کی بیٹی ، انینگریٹا پینکونسی کو تخلیقی ڈائریکٹر کی حیثیت سے کام کرنے والے ، نجی ملکیت میں موجود خاندانی کاروبار ہے۔',
