                'aboutUsContain4solo': 'اس وقت 15 مختلف ممالک کے 200 افراد ہیں جو سولو تیار کرنے اور برقرار رکھنے کے لئے کام کرتے ہیں۔ یہ سائٹ 9 زبانوں میں دستیاب ہے: انگریزی ، اطالوی ، جرمن ، چینی ، روسی ، ہسپانوی ، فرانسیسی ، کورین اور جاپانی۔ یہ سائٹ مکمل طور پر گھر میں تیار کی گئی ہے ، جس میں فلورنس آفس ہاؤسنگ گرافک ڈیزائن ، آئی ٹی ، کسٹمر سروس ، مارکیٹنگ اور خریدنے والے محکموں کے ساتھ بنایا گیا ہے۔ اسٹائلسٹ اور پریس ٹیمیں دنیا کے فیشن کیپیٹل - میلان میں سولو آفس سے کام کرتی ہیں۔',
