                'aboutUsContain1veralusso': 'ویب سائٹ میں تھیٹوپ قائم ڈیزائنرز کے ساتھ ساتھ ویلاس ینگ ابھرتی ہوئی صلاحیتوں کا بہترین انتخاب پیش کیا گیا ہے۔ ویرا لوسو کی بنیاد 1930 کی دہائی کے اوائل میں فلورنس میں رکھی گئی تھی ، جس میں ویا روما پر کمپنی کے معروف تصوراتی اسٹور کے افتتاح کے ساتھ تھا۔ آن لائن 1999 کے بعد سے ، کمپنی کل آمدنی کا 90 ٪ آن لائن فروخت سے منسوب کرتی ہے۔ آج تک یہ بانی کے پوتے ، آندریا پانکونسی کے ساتھ ، ایک 100 ٪ نجی ملکیت کا خاندانی کاروبار ہے ، جس میں سی ای او اور ان کی بیٹی ، انیگریٹا پینکونسی کی حیثیت سے تخلیقی ڈائریکٹر کی حیثیت سے کام کیا گیا ہے۔',
