                'descriptionavoirchic': 'مزید معلومات',
                'aboutUsTitleavoirchic': 'ایوورچک ایک اعلی آن لائن لگژری فیشن منزل ہے جس میں ہر ماہ 5 ملین زائرین اور دنیا بھر میں شپنگ ہوتی ہے۔',
                'aboutUsContainavoirchic': 'ویب سائٹ میں اعلی قائم کردہ ڈیزائنرز کے ساتھ ساتھ نوجوان ابھرتی ہوئی صلاحیتوں کا بہترین انتخاب پیش کیا گیا ہے۔ 1930 کی دہائی کے اوائل میں فلورنس میں برانڈ سلیبل کی بنیاد رکھی گئی تھی ، جس میں ویا روما پر کمپنی کے معروف تصوراتی اسٹور کے افتتاح کے ساتھ تھا۔ آن لائن 1999 کے بعد سے ، کمپنی کل آمدنی کا 90 ٪ آن لائن فروخت سے منسوب کرتی ہے۔ آج تک یہ بانی کے پوتے ، آندریا پانکونسی کے ساتھ سی ای او اور ان کی بیٹی ، انینگریٹا پینکونسی کو تخلیقی ڈائریکٹر کی حیثیت سے کام کرنے والے ، نجی ملکیت میں موجود خاندانی کاروبار ہے۔',
                'aboutUsContain1avoirchic': 'اس سائٹ میں لباس ، جوتے ، بیگ ، لوازمات ، عیش و آرام کی گھریلو اندرونی اور خوبصورتی کا ایک وسیع انتخاب پیش کیا گیا ہے ، جس میں مرد ، خواتین اور بچوں کے لئے دستیاب مصنوعات کے ساتھ سب سے زیادہ وقار ڈیزائنرز جیسے بیلنسیاگا ، ویٹمنٹ ، آف وائٹ ، جے ڈبلیو۔ اینڈرسن ، بالمین ، ڈولس اور گبانا ، گچی ، سینٹ لارینٹ ، ویلنٹینو ، گیوینچی ، لوئی ، جیکیمس اور بہت کچھ۔',
                'aboutUsContain2avoirchic': 'اس وقت 15 مختلف ممالک کے 200 افراد ہیں جو برانڈ سلیبل تیار کرنے اور برقرار رکھنے کے لئے کام کرتے ہیں۔ یہ سائٹ 9 زبانوں میں دستیاب ہے: انگریزی ، اطالوی ، جرمن ، چینی ، روسی ، ہسپانوی ، فرانسیسی ، کورین اور جاپانی۔ یہ سائٹ مکمل طور پر گھر میں تیار کی گئی ہے ، جس میں فلورنس آفس ہاؤسنگ گرافک ڈیزائن ، آئی ٹی ، کسٹمر سروس ، مارکیٹنگ اور خریدنے والے محکموں کے ساتھ بنایا گیا ہے۔ اسٹائلسٹ اور پریس ٹیمیں دنیا کے فیشن کیپیٹل - میلان میں برانڈ سلیبلز کے دفتر سے کام کرتی ہیں۔',
                'aboutUsContain3avoirchic': 'تمام احکامات دنیا بھر میں برانڈ سلیبل کے ہیڈ کوارٹر سے خانوں میں بھیجے جاتے ہیں جو زیادہ سے زیادہ نگہداشت کے ساتھ تیار ہوتے ہیں اور دستخطی جوتوں کے تھیلے سے لے کر ذاتی ربن تک بہترین مواد استعمال کرتے ہیں۔',
                'aboutUsContain4avoirchic': 'برانڈ سلابیل نے 2008 میں 1.5 ملین منفرد زائرین کو سائٹ تک رسائی حاصل کی تھی اور وہ 2017 میں 53 ملین منفرد زائرین تک پہنچ چکی ہے۔ آن لائن فروخت کا 15 فیصد سے زیادہ امریکہ سے پیدا ہوتا ہے ، اس کے بعد جرمنی ، برطانیہ ، اٹلی ، چین اور فرانس شامل ہیں۔',
                'aboutUsContain5avoirchic': 'برانڈ سلابیلس خصوصی خدمات اور ٹریڈ مارک اقدامات کی ایک صف کے ساتھ لگژری خوردہ زمین کی تزئین کی حدود کو آگے بڑھاتا ہے جس میں بائ ایٹ فرسٹ ، لگژری کلب ، جوتے کلب ، ایل وی آر استحقاق اور ایل وی آر ایڈیشن شامل ہیں۔',
